INSERT INTO `table_products` (`products_id`, `title`, `price`, `model`, `seo_words`, `seo_description`, `mini_description`, `image`, `description`, `mini_features`, `features`, `datetime`, `new`, `leader`, `sale`, `visible`, `count`, `type_product`, `model_id`, `yes_like`) VALUES
(23, 'Catalyst 2960', 100, 'Catalyst', 'Catalyst ', 'WS-C2960C-8TC-S', '<ul>\r\n	<li><strong>Typ urządzenia &nbsp;&nbsp; </strong>12-portowy przełącznik, Zarządzalny</li>\r\n	<li><strong>Typ obudowy&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; </strong>Desktop, montowany w szafie, montowany na ścianie - 1U</li>\r\n	<li><strong>RAM&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </strong>16 MB</li>\r\n	<li><strong>Pamięć Flash&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </strong>64 MB</li>\r\n</ul>\r\n', 'switch-2384.png', '<p>&nbsp; Przełącznik WS-C2940-8TT-S to w zasadzie uzupełnienie serii przełącznik&oacute;w 2950 o mały montowany w 9&quot; calowych szafkach przełącznik z uplinkiem gigabitowym.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Przełączniki serii 2950 to doskonałe przełączniki przełączające w warstwie drugiej. Dostępny jest szeroki wyb&oacute;r przełącznik&oacute;w tej serii, należy zauważyć, że przełączniki występują w dw&oacute;ch wersjach funkcjonalnych &ndash; z oprogramowaniem SI (Standard Image) oraz EI ( Enchanced Imagage).</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; R&oacute;żnice istotne dla większości użytkownik&oacute;w tych przełącznik&oacute;w należy sprowadzić do ograniczenia w wersji SI tworzenia vlan&oacute;w w zakresie od 1-1024 oraz możliwość użycia max. 64 VLAN w wersji SI i odpowiednio 256 w wersji EI.</p>\r\n', '<ul>\r\n	<li>Cisco Catalyst 2960C</li>\r\n	<li>Switch 12 FE PoE,</li>\r\n	<li>2 x Dual Uplink,</li>\r\n	<li>Lan Base</li>\r\n</ul>\r\n', '<table align="left" border="1" cellpadding="0" cellspacing="0" style="width:500px">\r\n	<tbody>\r\n		<tr>\r\n			<td><strong>Interfejsy</strong></td>\r\n			<td>\r\n			<ul>\r\n				<li>2 porty 1000Base-T RJ-45</li>\r\n				<li>12 port&oacute;w 100Base-TX RJ-45 - PoE</li>\r\n				<li>1 port konsolowy - mini-USB Typ B</li>\r\n				<li>1 port serial (RS-232) RJ-45</li>\r\n				<li>2 porty SFP (mini-GBIC)</li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Oprogramowanie</strong></td>\r\n			<td>Cisco IOS LAN Base</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Cechy</strong></td>\r\n			<td>\r\n			<ul>\r\n				<li>DHCP, Power over Ethernet (PoE), autonegocjacja, BOOTP, ARP, VLAN, auto-uplink (auto MDI/MDI-X), IGMP snooping, Syslog, DiffServ, Broadcast Storm Control, IPv6, Multicast Storm Control, Unicast Storm Control, Spanning Tree Protocol (STP), DHCP snooping, Dynamic Trunking Protocol (DTP),</li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Zgodność z normami</strong></td>\r\n			<td>\r\n			<ul>\r\n				<li>IEEE 802.3, IEEE 802.3u,</li>\r\n				<li>IEEE 802.1D, IEEE 802.1Q,</li>\r\n				<li>IEEE 802.3ab, IEEE 802.1p,</li>\r\n				<li>IEEE 802.3x, IEEE 802.3ad (LACP),</li>\r\n				<li>IEEE 802.1w, IEEE 802.1x, IEEE 802.1s</li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Pamięć Flash</strong></td>\r\n			<td>16 MB</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Zasilacz</strong></td>\r\n			<td>Zasilacz wewnętrzny</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Wymagane napięcie</strong></td>\r\n			<td>AC 120/230 V (50/60 Hz)</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Szerokość</strong></td>\r\n			<td>44,5 cm</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Głębokość</strong></td>\r\n			<td>43,1 cm</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Wysokość</strong></td>\r\n			<td>4,4 cm</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n', '2016-08-18 00:14:31', 0, 1, 1, 1, 3, 'switch', 1, 1),
(24, 'Catalyst 2970', 1, 'Catalyst', 'Catalyst 2970', 'WS-C2970G-24T-E', '<ul>\r\n	<li><strong>Typ urządzenia &nbsp;&nbsp; </strong>24-portowy przełącznik, zarządzalny - stakowalny</li>\r\n	<li><strong>Typ obudowy&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; </strong>Desktop - 1.5U</li>\r\n	<li><strong>Porty&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </strong>24 porty 10/100/1000 + 4 porty SFP</li>\r\n	<li><strong>Pamięć Flash&nbsp;&nbsp;&nbsp;&nbsp; </strong>16 MB</li>\r\n	<li><strong>RAM&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; </strong>128 MB</li>\r\n</ul>\r\n', 'switch-2485.png', '<p>&nbsp;&nbsp;&nbsp;&nbsp; Przełącznik WS-C2970G-24TS-E to bardzo ciekawa propozycja dla os&oacute;b szukających tańszego przełącznika w pełni gigabitowego firmy Cisco. Przełączniki 2970G oferują 24 gigabitowe porty.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Matryca przełączająca tego przełącznika (backplane) pracuje z prędkością 28GBps to idealnie dobrana wydajność matrycy do tego typu przełącznika.</p>\r\n', '<ul>\r\n	<li>Switch Cisco Catalyst 2970</li>\r\n	<li>24 PORT 10/100/1000T</li>\r\n	<li>4SFP EI</li>\r\n</ul>\r\n', '<table align="left" border="1" cellpadding="0" cellspacing="0" style="width:500px">\r\n	<tbody>\r\n		<tr>\r\n			<td><strong>Interfejsy</strong></td>\r\n			<td>\r\n			<ul>\r\n				<li>48 port&oacute;w RJ-45&nbsp;10Base-T/100Base-TX/1000Base-T</li>\r\n				<li>1 port RJ-45 10Base-T/100Base-TX -</li>\r\n				<li>1 port&nbsp; konsolowy RJ-45&nbsp;</li>\r\n				<li>4 porty SFP</li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Rozmiar tablicy adres&oacute;w MAC</strong></td>\r\n			<td>16 000 wpisy</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Cechy</strong></td>\r\n			<td>\r\n			<ul>\r\n				<li>kontrola przepływu</li>\r\n				<li>wsparcie DHCP</li>\r\n				<li>auto-negocjacja</li>\r\n				<li>trunking</li>\r\n				<li>obsługa VLAN</li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Zgodność z normami</strong></td>\r\n			<td>\r\n			<ul>\r\n				<li>IEEE 802.3, IEEE 802.3u,</li>\r\n				<li>IEEE 802.1D, IEEE 802.1Q,</li>\r\n				<li>IEEE 802.3ab, IEEE 802.1p,</li>\r\n				<li>IEEE 802.3x, IEEE 802.3ad (LACP),</li>\r\n				<li>IEEE 802.1w, IEEE 802.1x, IEEE 802.1s</li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Pamięć Flash</strong></td>\r\n			<td>16 MB</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Zasilacz</strong></td>\r\n			<td>Zasilacz wewnętrzny</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Wymagane napięcie</strong></td>\r\n			<td>AC 120/230 V (50/60 Hz)</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Szerokość</strong></td>\r\n			<td>44,5 cm</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Głębokość</strong></td>\r\n			<td>43,1 cm</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Wysokość</strong></td>\r\n			<td>4,4 cm</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n', '2016-08-18 00:25:20', 1, 1, 0, 1, 5, 'switch', 1, 1),
