(30, 'Catalyst 6840-X', 3020, 'Catalyst', 'C6840-X-1100W-AC', 'Catalyst ', '<ul>\n	<li><strong>Typ urządzenia &nbsp;&nbsp; </strong>32-portowy przełącznik</li>\n	<li><strong>Typ obudowy&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; </strong>Montowany w stojaku</li>\n	<li><strong>Pamięć Flash&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </strong>2 GB (max)</li>\n	<li><strong>Porty&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </strong>24 porty 10/100 (PoE) + 2 porty SFP</li>\n</ul>\n', 'switch-3096.png', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Przełącznik Cisco WS-C3560V2-24TS-E to przełącznik z 24-ma portami fast Ethernet 10/100 Mbit oraz dwoma uniwersalnymi portami SFP 1Gb. Ten przełącznik posiada oprogramowanie w rozszerzonej wersji IP Services.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Przełączniki serii Cisco 3560V2 to swoiste odświeżenie dobrze sprawdzonej serii Cisco 3560.</p>\r\n\r\n<p>Cecha szczeg&oacute;lna kt&oacute;re charakteryzuje przełączniki tej serii to niższe zużycie energii elektrycznej w stosunku do poprzednik&oacute;w o około 30% oraz wsparcie technologii Cisco EnergyWise umożliwiającej wdrożenie mechanizm&oacute;w og&oacute;lnokorporacyjnego zarządzania energią elektryczną. Technologia EnergyWise to kluczowy składnik promowanej przez Cisco architektury &bdquo;Sieci bez Granic&rdquo;. W ramach technologii EnergyWise klienci mogą korzystać z dedykowanego oprogramowania monitorującego zużycie oraz optymalizację zużycia energii elektrycznej przez urządzenia zasilane z PoE.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Przełączniki Cisco serii 3560V2 to seria przełącznik&oacute;w dla przedsiębiorstw występująca w wielu wariantach konfiguracyjnych. Przełączniki te cieszą się popularnością w szczeg&oacute;lności z uwagi na przystępną cenę w stosunku do oferowanych funkcjonalności, wsparcie dla IPV6, obsługa przełączania w warstwie trzeciej czy obsługa rutingu ruchy multicast to tylko niekt&oacute;re powody dla kt&oacute;rych klienci wybierają ten produkt.</p>\r\n\r\n<p>Przełączniki tej serii są dostępne w wersjach 48 i 24 portowych z uplinkami gigabitethernet SFP oraz z portami miedzianymi o prędkości 10/100 MBit/s. Dostępne są wersje przełącznik&oacute;w w standardzie PoE.</p>\r\n', '<ul>\r\n	<li>Cisco Catalyst 6840-X</li>\r\n	<li>Power Supply AC-750W</li>\r\n</ul>\r\n', '<table align="left" border="1" cellpadding="0" cellspacing="0" style="width:500px">\r\n	<tbody>\r\n		<tr>\r\n			<td><strong>Rodzaj urządzenia</strong></td>\r\n			<td>48-portowy przełącznik, zarządzalny, stakowalny</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Rodzaj obudowy</strong></td>\r\n			<td>Montowany w stelażu, 1U</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Subtyp</strong></td>\r\n			<td>Fast Ethernet</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Protokoły routingu</strong></td>\r\n			<td>OSPF, IGRP, BGP-4, RIP-1, RIP-2, EIGRP, HSRP, IGMP, DVMRP, PIM-SM, statyczny routing IP, PIM-DM</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Protokoły zdalnego zarządzania</strong></td>\r\n			<td>SNMP 1, RMON 1, RMON 2, SNMP, Telnet, SNMP 3, SNMP 2c</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>RAM</strong></td>\r\n			<td>128 MB</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Cechy</strong></td>\r\n			<td>Kontrola przepływu, możliwość pełnego duplexu, routing, Autowykrywanie urządzenia, IP-routing, DHCP, autonegocjacja, ARP, trunking, r&oacute;wnoważenie obciążenia, VLAN, auto-uplink (auto MDI/MDI-X), IGMP snooping, zarządzalność, stakowalny, IPv6</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Interfejsy</strong></td>\r\n			<td>48 port&oacute;w 10Base-T/100Base-TX RJ-45<br />\r\n			1 port konsolowy RJ-45<br />\r\n			2 porty network stack device<br />\r\n			4 porty SFP (mini-GBIC)</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Wymagane napięcie</strong></td>\r\n			<td>AC 120/230 V ( 50/60 Hz )</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Zużycie energii</strong