y awariami)</strong></td>\r\n			<td>217,824 godzin</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Szerokość</strong></td>\r\n			<td>44.5 cm</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Głębokość</strong></td>\r\n			<td>30.1 cm</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Wysokość</strong></td>\r\n			<td>4.4 cm</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Waga</strong></td>\r\n			<td>4.1 kg</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Minimalna temperatura pracy</strong></td>\r\n			<td>0 &deg;C</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Maksymalna temperatura pracy</strong></td>\r\n			<td>45 &deg;C</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Metoda uwierzytelniania</strong></td>\r\n			<td>Kerberos, Secure Shell (SSH), RADIUS, TACACS+</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n', '2016-08-18 02:19:38', 1, 0, 0, 1, 2, 'switch', 1, 1),
(33, 'PULSAR S54 ', 215, 'Pulsar', 'Switch 5-portowy (4xPoE) S54 dla 4 kamer IP PULSAR', 'PULSAR ', '<ul>\r\n	<li>5 port&oacute;w 10/100 Mb/s</li>\r\n	<li>4 porty PoE</li>\r\n	<li>Sygnalizacja optyczna</li>\r\n	<li>Wymiary 118x28x85mm</li>\r\n</ul>\r\n', 'switch-3395.png', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; S54 to 5-portowy switch PoE przeznaczony do zasilania kamer IP pracujących w standardzie IEEE 802.3af. Na portach od 1 do 4 posiada funkcję automatycznej detekcji urządzeń PoE. Port UPLINK służy do podłączenia kolejnego urządzenia sieciowego np. rejestratora. Diody LED znajdujące się na przednim panelu służą do sygnalizacji stanu pracy.<br />\r\nTechnologia PoE pozwala obniżyć koszty instalacji oraz zapewnia połączenie sieciowe.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; Możemy w ten spos&oacute;b zasilić nie tylko kamery ale także inne urządzenia pracujące w tej technologii np. telefon IP, access point czy choćby router.</p>\r\n', '<ul>\r\n	<li>Switch 5-portowy;</li>\r\n	<li>4xPoE;</li>\r\n	<li>Auto MDI/MDIX;</li>\r\n	<li>IEEE802.3af, 802.3u, 802.3x,</li>\r\n	<li>CSMA/CD, TCP/IP;</li>\r\n</ul>\r\n', '<p>&bull; 5 port&oacute;w 10/100 Mb/s<br />\r\n&bull; 4 porty PoE (transfer danych i zasilanie)<br />\r\n&bull; 15,4W dla każdego portu PoE (przy pełnym obsadzeniu port&oacute;w PoE wartość sumaryczna poboru mocy nie powinna przekroczyć 48W)<br />\r\n&bull; Obsługa urządzeń zgodnych ze standardem IEEE802.3af<br />\r\n&bull; Obsługa funkcji auto-learning i auto-aging adres&oacute;w MAC<br />\r\n&bull; Sygnalizacja optyczna (diody LED)<br />\r\n&bull; Zasilacz typu desktop PSD 480125 (48VDC/1.25A/60W) w zestawie<br />\r\n&bull; Dodatkowe elementy montażowe<br />\r\n&bull; Temperatura pracy od -10 do +45 stopni<br />\r\n&bull; Wymiary 118x28x85mm (WxHxD)<br />\r\n&nbsp;</p>\r\n', '2016-08-18 02:27:39', 0, 1, 1, 1, 3, 'switch', 2, 1),
(34, 'TP-LINK TL-SF1008D', 50, 'TP-LINK', 'Switch 8-portowy TP-LINK TL-SF1008D N29918', 'TP-LINK', '<ul>\r\n	<li><strong>Typ urządzenia &nbsp;&nbsp; </strong>32-portowy przełącznik</li>\r\n	<li><strong>Typ obudowy&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; </strong>Montowany w stojaku</li>\r\n	<li><strong>Pamięć Flash&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </strong>2 GB (max)</li>\r\n	<li><strong>Porty&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </strong>24 porty 10/100 (PoE) + 2 porty SFP</li>\r\n</ul>\r\n', 'switch-3441.png', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Urządzenie TL-SF1008D to przełącznik Fast Ethernet przeznaczony do użytku domowego lub biurowego. Każdy z 8 port&oacute;w urządzenia jest wyposażony w funkcję automatycznego krosowania MDI/MDIX umożliwiając szybką instalację urządzenia bez konieczności sprawdzania typu użytych kabli.<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Przełącznik TL-SF1008D posiada 8 port&oacute;w RJ45 Fast Ethernet 10/100Mb/s z funkcją automatycznej negocjacji szybkości połączeń. Dzięki funkcji MDI/MDIX nie ma konieczności użycia krosowanych kabli. Architektura non-blocking umożliwia przekazywanie i filtrowanie pakiet&oacute;w z pełną prędkością przy zachowaniu maksymalnej przepustowości. Ramki jumbo 10K powodują wzrost wydajności transferu dużych ilości danych. Obsługa kontroli przepustowości IEEE802.3x dla transmisji w pełnym dupleksie oraz funkcji backpressure dla transmisji w p&oacute;łdupleksie zapewnia płynny ruch sieciowy i niezawodną transmisję danych.<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp; Przełącznik nowej generacji TL-SF1008D Fast Ethernet korzysta z technologii umożliwiającej zwiększenie przepustowości sieci przy dużej oszczędności energii. Urządzenie automatycznie dopasowuje zużycie prądu w zależności od statusu połączenia i długości kabla, dbając o ochronę środowiska naturalnego.<br />\r\nAutomatyczne funkcje przełącznika sprawiają, że jego instalacja jest bezproblemowa i nie wymaga wprowadzania konfiguracji. Dzięki funkcji MDI/MDIX nie ma konieczności użycia krosowanych kabli. Funkcja automatycznej negocjacji połączeń wykrywa na każdym porcie prędkość transmisji podłączonego urządzenia (10 lub 100Mb/s) zapewniając najlepszą wydajność pracy.</p>\r\n', '<ul>\r\n	<li>8 port&oacute;w RJ45 10/100Mb/s</li>\r\n	<li>Technologia Green Ethernet</li>\r\n	<li>Obsługa funkcji auto-learning</li>\r\n</ul>\r\n', '<table align="left" border="1" cellpadding="0" cellspacing="0" style="width:500px">\r\n	<tbody>\r\n		<tr>\r\n			<td><strong>Rodzaj urządzenia</strong></td>\r\n			<td>48-portowy przełącznik, zarządzalny, stakowalny</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Rodzaj obudowy</strong></td>\r\n			<td>Montowany w stelażu, 1U</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Subtyp</strong></td>\r\n			<td>Fast Ethernet</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Protokoły routingu</strong></td>\r\n			<td>OSPF, IGRP, BGP-4, RIP-1, RIP-2, EIGRP, HSRP, IGMP, DVMRP, PIM-SM, statyczny routing IP, PIM-DM</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Protokoły zdalnego zarządzania</strong></td>\r\n			<td>SNMP 1, RMON 1, RMON 2, SNMP, Telnet, SNMP 3, SNMP 2c</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>RAM</strong></td>\r\n			<td>128 MB</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Cechy</strong></td>\r\n			<td>Kontrola przepływu, możliwość pełnego duplexu, routing, Autowykrywanie urządzenia, IP-routing, DHCP, autonegocjacja, ARP, trunking, r&oacute;wnoważenie obciążenia, VLAN, auto-uplink (auto MDI/MDI-X), IGMP snooping, zarządzalność, stakowalny, IPv6</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Interfejsy</strong></td>\r\n			<td>48 port&oacute;w 10Base-T/100Base-TX RJ-45<br />\r\n			1 port konsolowy RJ-45<br />\r\n			2 porty network stack device<br />\r\n			4 porty SFP (mini-GBIC)</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Wymagane napięcie</strong></td>\r\n			<td>AC 120/230 V ( 50/60 Hz )</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Zużycie energii</strong></td>\r\n			<td>75 Watt</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Oprogramowanie</strong></td>\r\n			<td>Enhanced Multilayer Software Image (EMI)</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Ilość zainstalowanych moduł&oacute;w (Maks.)</strong></td>\r\n			<td>0 (zainstalowany) / 4 (maks.)</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>MTBF (czas pracy między awariami)</strong></td>\r\n			<td>217,824 godzin</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Szerokość</strong></td>\r\n			<td>44.5 cm</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Głębokość</strong></td>\r\n			<td>30.1 cm</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Wysokość</strong></td>\r\n			<td>4.4 cm</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Waga</strong></td>\r\n			<td>4.1 kg</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Minimalna temperatura pracy</strong></td>\r\n			<td>0 &deg;C</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Maksymalna temperatura pracy</strong></td>\r\n			<td>45 &deg;C</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Metoda uwierzytelniania</strong></td>\r\n			<td>Kerberos, Secure Shell (SSH), RADIUS, TACACS+</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n', '2016-08-18 09:16:39', 1, 0, 0, 1, 3, 'switch', 3, 1),
(35, 'Switch S94 ', 342, 'TP-LINK', 'Switch 9-portowy (4xPoE + 4xLAN) S94 dla 4 kamer IP PULSAR', 'Switch ', '<ul>\r\n	<li>9 port&oacute;w 10/100 Mb/s</li>\r\n	<li>4 porty PoE (transfer danych i zasilanie)</li>\r\n	<li>4 porty LAN</li>\r\n	<li>15,4W dla każdego portu PoE</li>\r\n</ul>\r\n', 'switch-3510.png', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; S94 to 9-portowy switch PoE przeznaczony do zasilania kamer IP pracujących w standardzie IEEE 802.3af. Na portach od 1 do 4 posiada funkcję automatycznej detekcji urządzeń PoE. Port UPLINK służy do podłączenia kolejnego urządzenia sieciowego np. rejestratora.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Diody LED znajdujące się na przednim panelu służą do sygnalizacji stanu pracy.<br />\r\nTechnologia PoE pozwala obniżyć koszty instalacji oraz zapewnia połączenie sieciowe. Możemy w ten spos&oacute;b zasilić nie tylko kamery ale także inne urządzenia pracujące w tej technologii np. telefon IP, access point czy choćby router.</p>\r\n', '<ul>\r\n	<li>Switch 9-portowy</li>\r\n	<li>4xPoE</li>\r\n	<li>4xLAN</li>\r\n	<li>Auto MDI/MDIX</li>\r\n</ul>\r\n', '<p>&bull; 9 port&oacute;w 10/100 Mb/s<br />\r\n&bull; 4 porty PoE (transfer danych i zasilanie)<br />\r\n&bull; 4 porty LAN<br />\r\n&bull; 15,4W dla każdego portu PoE (przy pełnym obsadzeniu port&oacute;w PoE</p>\r\n\r\n<p>wartość sumaryczna poboru mocy nie powinna przekroczyć 48W)<br />\r\n&bull; Obsługa urządzeń zgodnych ze standardem IEEE802.3af<br />\r\n&bull; Obsługa funkcji auto-learning i auto-aging adres&oacute;w MAC<br />\r\n&bull; Sygnalizacja optyczna (diody LED)<br />\r\n&bull; Zasilacz typu desktop PSD 480150 (48VDC/1.25A/60W) w zestawie<br />\r\n&bull; Dodatkowe elementy montażowe<br />\r\n&bull; Temperatura pracy od -10 do +45 stopni<br />\r\n&bull; Wymiary 190x28x115mm (WxHxD)</p>\r\n', '2016-08-18 09:24:58', 0, 0, 1, 1, 3, 'switch', 3, 1);
