(36, 'NETIS SWITCH ST3105S', 31, 'NETIS', 'NETIS SWITCH 5-PORT 100MB ST3105S', 'NETIS ', '<ul>\r\n	<li>Kolor obudowy:&nbsp; czarny</li>\r\n	<li>Waga:&nbsp; 0,13 kg</li>\r\n	<li>Symbol:&nbsp;&nbsp; ST3105S</li>\r\n</ul>\r\n', 'switch-3660.jpg', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Switch Netis ST3105S to wyjątkowo mały przełącznik z 5 portami fast Ethernet, funkcją MDI/MDIX oraz automatyczną negocjacją na wszystkich portach. Netis ST3105S, to połączenie funkcji plug-and-play, funkcji oszczędzania energii oraz niskich koszt&oacute;w.</p>\r\n', '<ul>\r\n	<li>Kolor obudowy:&nbsp; czarny</li>\r\n	<li>Waga:&nbsp; 0,13 kg</li>\r\n	<li>Symbol:&nbsp;&nbsp; ST3105S</li>\r\n</ul>\r\n', '<table align="left" border="1" cellpadding="0" cellspacing="0" style="width:500px">\r\n	<tbody>\r\n		<tr>\r\n			<td>Liczba port&oacute;w 10/100 Mbps</td>\r\n			<td><strong>5 szt.</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Standardy sieciowe</td>\r\n			<td><strong>IEEE 802.3 10Base-T, IEE802.3u 100Base-TX, IEEE 802.3x Flow Control</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Rozmiar tablicy adres&oacute;w MAC</td>\r\n			<td><strong>2k</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Kolor obudowy</td>\r\n			<td><strong>czrny</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Zasilanie</td>\r\n			<td><strong>Zasilacz DC 5V/800mA(Output)</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Informacje dodatkowe</td>\r\n			<td>Metoda transmisji: Store and Forward, Prędkość transmisji: 10/100Mbps (Half-duplex), 20/200Mbps (Full-duplex), Temperatura pracy: 0?~40?, Temperatura przechowywania: -40?~70?, Wilgotność pracy: 10%~90% non-condensing, Wilgotność przechowywania: 5%~90% non-condensing</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n', '2016-08-18 09:38:10', 1, 0, 1, 1, 3, 'switch', 4, 1),
(37, 'D-LINK GO-SW-5E  SWITCH', 32, 'D-Link', 'D-LINK GO-SW-5E 5X100MBPS ETHERNET SWITCH (GO-SW-5E/ E)', 'D-LINK', '<ul>\r\n	<li><strong>Typ (wg producenta):</strong>&nbsp;&nbsp;&nbsp; GO-SW-5E/E</li>\r\n	<li><strong>Liczba port&oacute;w 10/100 Mbps</strong>: &nbsp;&nbsp; 5 szt.</li>\r\n	<li><strong>Instalacja:&nbsp;&nbsp;</strong> Plug-and-play</li>\r\n</ul>\r\n', 'switch-3718.jpg', '<p><strong>Szybkość przełączania</strong></p>\r\n\r\n<ul style="list-style-type:disc">\r\n	<li>5 port&oacute;w Fast Ethernet 10/100 Mb/s</li>\r\n	<li>Full/half-duplex dla Ethernet/Fast Ethernet</li>\r\n</ul>\r\n\r\n<p><strong>Instalacja</strong></p>\r\n\r\n<ul style="list-style-type:disc">\r\n	<li>Plug-and-play</li>\r\n	<li>Auto MDI/MDIX crossover dla wszystkich port&oacute;w</li>\r\n</ul>\r\n\r\n<p><strong>Technologia D-Link Green</strong></p>\r\n\r\n<ul style="list-style-type:disc">\r\n	<li>IEEE 802.3az Energy Efficient Ethernet</li>\r\n	<li>Tryb oczekiwania</li>\r\n	<li>Funkcja wykrywania długości kabla RJ-45</li>\r\n	<li>Funkcja wykrywania statusu podłączonego urządzenia &nbsp;</li>\r\n</ul>\r\n\r\n<p><strong>Standardy</strong></p>\r\n\r\n<ul style="list-style-type:disc">\r\n	<li>IEEE 802.3 10BASE-T Ethernet (twisted-pair copper)</li>\r\n	<li>ANSI/IEEE 802.3 NWay auto-negotiation</li>\r\n	<li>IEEE 802.3x flow control&nbsp;IEEE 802.3u</li>\r\n	<li>100BASE-TX Fast Ethernet (twisted-pair copper)</li>\r\n	<li>IEEE 802.3az EEE</li>\r\n</ul>\r\n\r\n<p><strong>Przełączanie</strong></p>\r\n\r\n<ul style="list-style-type:disc">\r\n	<li>1 Gb/s switching fabric&nbsp;</li>\r\n</ul>\r\n\r\n<p><strong>Topologia</strong></p>\r\n\r\n<ul style="list-style-type:disc">\r\n	<li>Gwiazda</li>\r\n</ul>\r\n\r\n<p><strong>Protok&oacute;ł</strong></p>\r\n\r\n<ul style="list-style-type:disc">\r\n	<li>CSMA/CD&nbsp;</li>\r\n</ul>\r\n\r\n<p><strong>Przepustowość</strong></p>\r\n\r\n<ul style="list-style-type:disc">\r\n	<li>Ethernet\r\n	<ul style="list-style-type:circle">\r\n		<li>10 Mb/s (half duplex)</li>\r\n		<li>20 Mb/s (full duplex)&nbsp;</li>\r\n	</ul>\r\n	</li>\r\n	<li>Fast Ethernet\r\n	<ul style="list-style-type:circle">\r\n		<li>100 Mb/s (half duplex)</li>\r\n		<li>200 Mb/s (full duplex)</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p><strong>Funkcje sieciowe</strong></p>\r\n\r\n<ul style="list-style-type:disc">\r\n	<li>Auto MDI/MDIX</li>\r\n</ul>\r\n\r\n<p><strong>Kablesieciowe</strong></p>\r\n\r\n<ul style="list-style-type:disc">\r\n	<li>10BASE-T:\r\n	<ul style="list-style-type:circle">\r\n		<li>UTP CAT 3/4/5/5e (100 m max.)</li>\r\n		<li>EIA/TIA-586 100-ohm STP (100 m max.)&nbsp;</li>\r\n	</ul>\r\n	</li>\r\n	<li>100BASE-TX\r\n	<ul style="list-style-type:circle">\r\n		<li>UTP CAT 5/5e (100 m max.)</li>\r\n		<li>EIA/TIA-568 100-ohm STP (100 m max.)</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n', '<ul>\r\n	<li>5 port&oacute;w Fast Ethernet</li>\r\n	<li>Full/half-duplex</li>\r\n	<li>Auto MDI/MDIX crossover</li>\r\n	<li>IEEE 802.3 10BASE-T</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n', '', '2016-08-18 09:52:29', 1, 0, 0, 1, 4, 'switch', 5, 1),
(38, 'NETIS ST3108P', 35, 'NETIS', 'SWITCH NETIS NETIS ST3108P ( 8X10/ 100 )', 'NETIS ', '<ul>\r\n	<li><strong>Interfejsy: &nbsp; </strong>10/100 Mb/s RJ45</li>\r\n	<li>\r\n	<p><strong>Zasilacz:&nbsp; </strong>zewnętrzny</p>\r\n	</li>\r\n	<li><strong>Pamięć Flash: &nbsp;&nbsp;&nbsp; </strong>2 GB (max)</li>\r\n</ul>\r\n', 'switch-3884.jpg', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Switch ST3108P provides 8 10/100Mbps Auto-Negotiation RJ45 ports. All ports support Auto MDI/MDIX function, eliminating the need for crossover cables or Uplink ports. This switch provides you with a low-cost, easy-to-use, high-performance, seamless and standard upgrade to improve your old network to a 100Mbps network. It will boost your network performance with up to 200Mbps full duplex data transfer speed.</p>\r\n', '<ul style="list-style-type:inherit">\r\n	<li>8* 10/100Mbps RJ45 ports,</li>\r\n	<li>Auto-Negotiation</li>\r\n	<li>Auto MDI/ MDIX</li>\r\n</ul>\r\n', '<ul style="list-style-type:inherit">\r\n	<li>8* 10/100Mbps RJ45 ports, Auto-Negotiation &amp; Auto MDI/ MDIX</li>\r\n	<li>IEEE 802.3x flow control for Full Duplex mode and backpressure for Half Duplex mode</li>\r\n	<li>1.6Gbps switching fabric capacity/backplane bandwidth</li>\r\n	<li>Green Ethernet technology for effective power saving</li>\r\n	<li>LED indicators for simple diagnostics and management</li>\r\n	<li>Plug and play, no configuration required</li>\r\n	<li>Compact plastic case, desktop design for home and office use</li>\r\n</ul>\r\n', '2016-08-18 10:03:48', 0, 1, 1, 1, 2, 'switch', 4, 1),
(39, 'TP-LINK SF1005DV.11', 38, 'TP-LINK', 'TP-LINK [TL-SF1005DV.11] PRZEŁĄCZNIK TYPU DESKTOP, 5 PORTÓW 10/ 100MB/ S', 'TP-LINK', '<ul>\r\n	<li><strong>Kolor obudowy: &nbsp;</strong> Biało-czarny</li>\r\n	<li>\r\n	<p><strong>Zasilacz:&nbsp; </strong>zewnętrzny</p>\r\n	</li>\r\n	<li><strong>Przepustowość: &nbsp;&nbsp;&nbsp;</strong>1Gb/s</li>\r\n</ul>\r\n', 'switch-3924.jpg', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Przełącznik TL-SF1005D posiada 5 port&oacute;w RJ45 Fast Ethernet 10/100Mb/s z funkcją automatycznej negocjacji szybkości połączeń. Dzięki funkcji MDI/MDIX nie ma konieczności użycia krosowanych kabli. Przełącznik posiada funkcję Plug-and-Play.Każdy port może działać jako zwykły port lub port uplink i można podłączyć do niego serwer, hub lub przełącznik przy wykorzystaniu kabla prostego lub krosowanego.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 5 portowy przełącznik Fast Ethernet 10/100M TP-LINK TL-SF1005D to rozwiązanie oszczędne i proste w użyciu. Umożliwia unowocześnienie sieci zapewniając prędkości transmisji danych do 100Mb/s.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Przełącznik wzmacnia wydajność połączeń dzięki transferowi danych w trybie full dupleksu. Przełączanie pakiet&oacute;w może odbywać się z prędkością, z jaką pakiety te są dostarczane.</p>\r\n', '<ul>\r\n	<li>24 10/100,</li>\r\n	<li>2 SFP,</li>\r\n	<li>Enhanced Image</li>\r\n</ul>\r\n', '<table align="left" border="1" cellpadding="0" cellspacing="0" style="width:500px">\r\n	<tbody>\r\n		<tr>\r\n			<td><strong>Rodzaj urządzenia</strong></td>\r\n			<td>48-portowy przełącznik, zarządzalny, stakowalny</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Rodzaj obudowy</strong></td>\r\n			<td>Montowany w stelażu, 1U</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Subtyp</strong></td>\r\n			<td>Fast Ethernet</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Protokoły routingu</strong></td>\r\n			<td>OSPF, IGRP, BGP-4, RIP-1, RIP-2, EIGRP, HSRP, IGMP, DVMRP, PIM-SM, statyczny routing IP, PIM-DM</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Protokoły zdalnego zarządzania</strong></td>\r\n			<td>SNMP 1, RMON 1, RMON 2, SNMP, Telnet, SNMP 3, SNMP 2c</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>RAM</strong></td>\r\n			<td>128 MB</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Cechy</strong></td>\r\n			<td>Kontrola przepływu, możliwość pełnego duplexu, routing, Autowykrywanie urządzenia, IP-routing, DHCP, autonegocjacja, ARP, trunking, r&oacute;wnoważenie obciążenia, VLAN, auto-uplink (auto MDI/MDI-X), IGMP snooping, zarządzalność, stakowalny, IPv6</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Interfejsy</strong></td>\r\n			<td>48 port&oacute;w 10Base-T/100Base-TX RJ-45<br />\r\n			1 port konsolowy RJ-45<br />\r\n			2 porty network stack device<br />\r\n			4 porty SFP (mini-GBIC)</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Wymagane napięcie</strong></td>\r\n			<td>AC 120/230 V ( 50/60 Hz )</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Zużycie energii</strong></td>\r\n			<td>75 Watt</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Oprogramowanie</strong></td>\r\n			<td>Enhanced Multilayer Software Image (EMI)</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Ilość zainstalowanych moduł&oacute;w (Maks.)</strong></td>\r\n			<td>0 (zainstalowany) / 4 (maks.)</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>MTBF (czas pracy między awariami)</strong></td>\r\n			<td>217,824 godzin</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Szerokość</strong></td>\r\n			<td>44.5 cm</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Głębokość</strong></td>\r\n			<td>30.1 cm</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Wysokość</strong></td>\r\n			<td>4.4 cm</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Waga</strong></td>\r\n			<td>4.1 kg</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Minimalna temperatura pracy</strong></td>\r\n			<td>0 &deg;C</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Maksymalna temperatura pracy</strong></td>\r\n			<td>45 &deg;C</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Metoda uwierzytelniania</strong></td>\r\n			<td>Kerberos, Secure Shell (SSH), RADIUS, TACACS+</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n', '2016-08-18 10:12:58', 0, 1, 1, 1, 2, 'switch', 6, 1),
(40, 'D-LINK DES-105', 63, 'D-Link', 'SWITCH D-LINK DES-105 ( 5X100MBPS ) (DES-105/ E)', 'D-LINK', '<ul>\r\n	<li><strong>Kolor obudowy: &nbsp;</strong> Czarny</li>\r\n	<li>\r\n	<p><strong>Zasilacz:&nbsp; </strong>Zasilacz zewnętrzny 5 V/1</p>\r\n	</li>\r\n	<li><strong>Przepustowość: &nbsp;&nbsp;&nbsp;</strong>1Gb/s</li>\r\n</ul>\r\n', 'switch-4048.jpg', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Przełącznik TL-SF1005D posiada 5 port&oacute;w RJ45 Fast Ethernet 10/100Mb/s z funkcją automatycznej negocjacji szybkości połączeń. Dzięki funkcji MDI/MDIX nie ma konieczności użycia krosowanych kabli. Przełącznik posiada funkcję Plug-and-Play.Każdy port może działać jako zwykły port lub port uplink i można podłączyć do niego serwer, hub lub przełącznik przy wykorzystaniu kabla prostego lub krosowanego.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 5 portowy przełącznik Fast Ethernet 10/100M TP-LINK TL-SF1005D to rozwiązanie oszczędne i proste w użyciu. Umożliwia unowocześnienie sieci zapewniając prędkości transmisji danych do 100Mb/s.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Przełącznik wzmacnia wydajność połączeń dzięki transferowi danych w trybie full dupleksu. Przełączanie pakiet&oacute;w może odbywać się z prędkością, z jaką pakiety te są dostarczane.</p>\r\n', '<ul>\r\n	<li>Praca Plug and Play</li>\r\n	<li>5 port&oacute;w 10/100Mbps</li>\r\n	<li>Nieblokujący sie mechanizm przełączania pakiet&oacute;w</li>\r\n	<li>Cicha paraca bez wiatrak&oacute;w</li>\r\n	<li>Priorytety QoS</li>\r\n</ul>\r\n', '<table align="left" border="1" cellpadding="0" cellspacing="0" style="width:500px">\r\n	<tbody>\r\n		<tr>\r\n			<td>Liczba port&oacute;w 10/100 Mbps</td>\r\n			<td><strong>5 szt.</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Przepustowość</td>\r\n			<td>\r\n			<p>Magistrala: 1Gbps</p>\r\n\r\n			<p>Ethernet: 10 Mbps (half duplex), 20 Mbps (full duplex)</p>\r\n\r\n			<p>Fast Ethernet: 100 Mbps (half duplex), 200 Mbps (full duplex)</p>\r\n\r\n			<p>Ethernet: 14,88