(41, 'LINKSYS SE2800-EU', 164, 'LINKSYS ', 'LINKSYS SE2800-EU SWITCH 10/ 100/ 1000 8 PORTÓW', 'LINKSYS ', '<ul>\r\n	<li><strong>Kolor obudowy: &nbsp;</strong> Czarny</li>\r\n	<li><strong>Zasilacz: &nbsp; </strong>Zasilacz zewnętrzny 12V</li>\r\n	<li><strong>Przepustowość: &nbsp;&nbsp;&nbsp;</strong>1Gb/s</li>\r\n	<li><strong>Standardy sieciowe:&nbsp; </strong>IEEE 802.3, IEEE 802.3u</li>\r\n</ul>\r\n', 'switch-4138.jpg', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Ten kompaktowy switch został zaprojektowany z myślą o optymalizacji miejsca oraz łatwości instalacji i użytkowania. Dlatego nie wymaga żadnej konfiguracji. Wystarczy podłaczyć koputer, drukarkę, konsole gier aby dołączyćurządzenie sieciowe.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Technologia priorytetyzacji pakiet&oacute;w umożliwia większą wydajność urządzenia i wpływa na bezproblematyczną obsługę strumieni wideo czy granie po sieci. Automatyczna negocjacja prędkości zapewni optymalnąprędkość dla podłączonych urządzeń.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Urządzenie posiada specjalne funkcje optymalizacji pracy: Automatyczne odłączanie nieużywanych port&oacute;w oraz oszczędne diody statusu port&oacute;w</p>\r\n', '<ul>\r\n	<li>24 10/100,</li>\r\n	<li>2 SFP,</li>\r\n	<li>Enhanced Image</li>\r\n	<li>24 miesiące</li>\r\n</ul>\r\n', '<table align="left" border="1" cellpadding="0" cellspacing="0" style="width:500px">\r\n	<tbody>\r\n		<tr>\r\n			<td><strong>Metoda przekazywania</strong></td>\r\n			<td>Store and forward</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Kolor </strong></td>\r\n			<td>Czarny</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Rodzaj przełącznika</strong></td>\r\n			<td>Przełącznik sieciowy (LAN)</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Protokoły routingu</strong></td>\r\n			<td>OSPF, IGRP, BGP-4, RIP-1, RIP-2, EIGRP, HSRP, IGMP, DVMRP, PIM-SM, statyczny routing IP, PIM-DM</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Protokoły zdalnego zarządzania</stro