(43, 'D-LINK DES-1008D', 43, 'D-Link', 'Switch D-LINK DES-1008D', 'D-Link', '<ul>\r\n	<li><strong>Kolor obudowy: &nbsp;</strong> Czarny</li>\r\n	<li>\r\n	<p><strong>Zasilacz:&nbsp; </strong>Zasilacz zewnętrzny 5 V/1</p>\r\n	</li>\r\n	<li><strong>Przepustowość: &nbsp;&nbsp;&nbsp;</strong>1Gb/s</li>\r\n</ul>\r\n', 'switch-4399.jpg', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Kompaktowy, biurkowy, przełącznik dedykowany dla małych biur i użytku domowego. Posiada 8 port&oacute;w FastEthernet 10/100Mb/s (RJ-45). Automatycznie rozpoznaje konfigurację sieci i wybiera największą z dostępnych prędkości oraz tryb&oacute;w połączenia. Funkcja Auto MDI-MDIX umożliwia wykorzystanie istniejącego okablowania niezależnie od rodzaju połączenia (tj. czy kabel jest z przeplotem czy bez). Brak wentylatora i małe wymiary obudowy zapewniają bezgłośną pracę i możliwość ustawienia urządzenia praktycznie w każdym miejscu.</p>\r\n', '<ul>\r\n	<li>Cisco Catalyst 3560V2</li>\r\n	<li>24 10/100,</li>\r\n	<li>2 SFP,</li>\r\n	<li>Enhanced Image</li>\r\n</ul>\r\n', '<p><strong>Załączone wyposażenie</strong>:&nbsp;&nbsp;&nbsp;&nbsp; zasilacz</p>\r\n\r\n<p><strong>Gwarancja</strong>:&nbsp; 24 miesiące</p>\r\n\r\n<p><strong>&nbsp;Rozmiar tablicy adres&oacute;w MAC</strong>: 2000 ,</p>\r\n\r\n<p><strong>Warstwa przełączania</strong>: 2 ,</p>\r\n\r\n<p><strong>Metoda przekazywania</strong>: store and forward ,</p>\r\n\r\n<p><strong>Prędkość magistrali</strong>: 1.6 Gbps ,</p>\r\n\r\n<p><strong>Przepustowość</strong>: 148.8 kpps ,</p>\r\n\r\n<p><strong>Gniazda sieciowe</strong>: 8 x 10/100</p>\r\n\r\n<p><strong>Standardy sieciowe</strong>:&nbsp; IEEE 802.3 , IEEE 802.3u , IEEE 802.3x</p>\r\n', '2016-08-18 11:24:55', 1, 0, 0, 1, 1, 'switch', 5, 1),
(44, 'TP-LINK TL-SF1008D', 37, 'TP-LINK', 'TP-LINK ', 'Switch TP-LINK TL-SF1008D', '<ul>\r\n	<li><strong>Kolor obudowy: &nbsp;</strong> Czarny</li>\r\n	<li>\r\n	<p><strong>Zasilacz:&nbsp; </strong>Zasilacz zewnętrzny 5 V/1</p>\r\n	</li>\r\n	<li><strong>Przepustowość: &nbsp;&nbsp;&nbsp;</strong>1Gb/s</li>\r\n</ul>\r\n', 'switch-4472.jpg', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Urządzenie TL-SF1008D to przełącznik Fast Ethernet przeznaczony do użytku domowego lub biurowego. Każdy z 8 port&oacute;w urządzenia posiada funkcję automatycznego krosowania MDI/MDIX pozwalając na szybką instalację urządzenia bez konieczności sprawdzania typu użytych kabli. Przełącznik TL-SF1008D jest przyjazny dla środowiska, gdyż korzysta z innowacyjnej technologii pozwalającej zaoszczędzić do 60%* zużytej energii. Ponadto, 70% opakowania produktu to materiał do ponownego przetworzenia.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Przełącznik TL-SF1008D posiada 8 port&oacute;w RJ45 Fast Ethernet 10/100Mb/s z funkcją automatycznej negocjacji szybkości połączeń. Dzięki funkcji MDI/MDIX nie ma konieczności użycia krosowanych kabli. Architektura non-blocking umożliwia przekazywanie i filtrowanie pakiet&oacute;w z pełną prędkością przy zachowaniu maksymalnej przepustowości. Ramki jumbo 10K powodują wzrost wydajności transferu dużych ilości danych. Obsługa kontroli przepustowości IEEE802.3x dla transmisji w pełnym dupleksie oraz funkcji backpressure dla transmisji w p&oacute;łdupleksie zapewnia płynny ruch sieciowy i niezawodną transmisję danych.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Przełącznik nowej generacji TL-SF1008D Fast Ethernet korzysta z technologii umożliwiającej zwiększenie przepustowości sieci przy dużej oszczędności energii. Urządzenie automatycznie dopasowuje zużycie prądu w zależności od statusu połączenia i długości kabla, dbając o ochronę środowiska naturalnego. Urządzenie jest zgodne z europejską dyrektywą RoHS, ograniczającą użycie sprzętu wykonanego z niebezpiecznych dla środowiska materiał&oacute;w. Ponadto, 70% opakowania produktu nadaje się do ponowego przetworzenia.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Automatyczne funkcje przełącznika sprawiają, że jego instalacja jest bezproblemowa i nie wymaga wprowadzania konfiguracji. Dzięki funkcji MDI/MDIX nie ma konieczności użycia krosowanych kabli. Funkcja automatycznej negocjacji połączeń wykrywa na każdym porcie prędkość transmisji podłączonego urządzenia (10 lub 100Mb/s) zapewniając najlepszą wydajność pracy.<br />\r\n&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', '<ul>\r\n	<li>24 10/100,</li>\r\n	<li>2 SFP,</li>\r\n	<li>Enhanced Image</li>\r\n</ul>\r\n', '<table align="left" border="1" cellpadding="0" cellspacing="0" style="width:500px">\r\n	<tbody>\r\n		<tr>\r\n			<td><strong>Rodzaj urządzenia</strong></td>\r\n			<td>48-portowy przełącznik, zarządzalny, stakowalny</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Rodzaj obudowy</strong></td>\r\n			<td>Montowany w stelażu, 1U</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Subtyp</strong></td>\r\n			<td>Fast Ethernet</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Protokoły routingu</strong></td>\r\n			<td>OSPF, IGRP, BGP-4, RIP-1, RIP-2, EIGRP, HSRP, IGMP, DVMRP, PIM-SM, statyczny routing IP, PIM-DM</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Protokoły zdalnego zarządzania</strong></td>\r\n			<td>SNMP 1, RMON 1, RMON 2, SNMP, Telnet, SNMP 3, SNMP 2c</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>RAM</strong></td>\r\n			<td>128 MB</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Cechy</strong></td>\r\n			<td>Kontrola przepływu, możliwość pełnego duplexu, routing, Autowykrywanie urządzenia, IP-routing, DHCP, autonegocjacja, ARP, trunking, r&oacute;wnoważenie obciążenia, VLAN, auto-uplink (auto MDI/MDI-X), IGMP snooping, zarządzalność, stakowalny, IPv6</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Interfejsy</strong></td>\r\n			<td>48 port&oacute;w 10Base-T/100Base-TX RJ-45<br />\r\n			1 port konsolowy RJ-45<br />\r\n			2 porty network stack device<br />\r\n			4 porty SFP (mini-GBIC)</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Wymagane napięcie</strong></td>\r\n			<td>AC 120/230 V ( 50/60 Hz )</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Zużycie energii</strong></td>\r\n			<td>75 Watt</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Oprogramowanie</strong></td>\r\n			<td>Enhanced Multilayer Software Image (EMI)</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Ilość zainstalowanych moduł&oacute;w (Maks.)</strong></td>\r\n			<td>0 (zainstalowany) / 4 (maks.)</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>MTBF (czas pracy między awariami)</strong></td>\r\n			<td>217,824 godzin</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Szerokość</strong></td>\r\n			<td>44.5 cm</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Głębokość</strong></td>\r\n			<td>30.1 cm</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Wysokość</strong></td>\r\n			<td>4.4 cm</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Waga</strong></td>\r\n			<td>4.1 kg</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Minimalna temperatura pracy</strong></td>\r\n			<td>0 &deg;C</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Maksymalna temperatura pracy</strong></td>\r\n			<td>45 &deg;C</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Metoda uwierzytelniania</strong></td>\r\n			<td>Kerberos, Secure Shell (SSH), RADIUS, TACACS+</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n', '2016-08-18 11:32:04', 0, 0, 1, 1, 3, 'switch', 5, 1),
(45, 'Router ASUS RT-N14U', 135, 'ASUS', 'Router ASUS ', 'Router ASUS RT-N14U', '', 'router-4535.jpg', '<p>Asus RT-N14U to router bezprzewodowy przeznaczony do xDSL i 3G (z zastosowaniem zewnętrznego modemu 3G USB). Posiada cztery porty LAN RJ-45 10/100BaseTX, jeden port WAN RJ-45 10/100BaseTX a także łączność bezprzewodową w standardzie IEEE 802.11b/g/n z prędkością przesyłania danych do 300 Mbps.</p>\r\n', '<p>Asus RT-N14U to router bezprzewodowy przeznaczony do xDSL i 3G (z zastosowaniem zewnętrznego modemu 3G USB). Posiada cztery porty LAN RJ-45 10/100BaseTX,</p>\r\n', '<table align="left" border="1" cellpadding="0" cellspacing="0" style="width:500px">\r\n	<tbody>\r\n		<tr>\r\n			<td>Przeznaczenie</td>\r\n			<td>XDSL (sieci lokalne; telewizja kablowa) , 3G (kom&oacute;rkowe sieci telefoniczne)</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Interfejs WAN</td>\r\n			<td>1x 10/100BaseTX (RJ45)</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Interfejs LAN</td>\r\n			<td>4x 10/100BaseTX (RJ45)</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Obsługa sieci bezprzewodowej</td>\r\n			<td>Tak</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Przepustowość</td>\r\n			<td>IEEE 802.11b - 11Mbps 2.4GHz , IEEE 802.11g - 54Mbps 2.4GHz , IEEE 802.11n - 300Mbps 2.4GHz</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Protokoły i standardy sieciowe</td>\r\n			<td>PPTP , IEEE 802.11b , IEEE 802.11g , IEEE 802.11n , IEEE 802.3 , IEEE 802.3u , PPPoE , IPv4 , IEEE 802.11e , IEEE 802.11i , IEEE 802.11d , IPv6</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Funkcje</td>\r\n			<td>QoS , Serwer wydruku , Serwer FTP , WMM , Serwer Samba , Serwer multimedialny</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Złącze USB</td>\r\n			<td>2.0</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n', '2016-08-18 12:01:34', 1, 0, 0, 1, 4, 'router', 8, 1),
(46, 'Router ASUS 4G-N12', 626, 'ASUS', 'Router ASUS ', 'ASUS', '<ul>\r\n	<li>Przeznaczenie: <strong>3G (kom&oacute;rkowe sieci telefoniczne) , 4G</strong></li>\r\n	<li>Antena:&nbsp; <strong>2x 2 dBi , 2x 3 dBi</strong></li>\r\n	<li>Porty pozostałe: <strong>1x SIM</strong></li>\r\n	<li>Funkcje: <strong>NAT , DMZ , DHCP , WMM , NAPT</strong></li>\r\n</ul>\r\n', 'router-4684.jpg', '<p>Router bezprzewodowy z modemem 4G LTE/3G. Pracuje w standardach WiFi b/g/n. Posiada dwie zewnętrzne anteny modemu o mocy 2dBi, oraz dwie wewnętrzne anteny WiFi, o mocy 3dBi. Wyposażony jest w 4 gniazda LAN RJ45. Obsługuje szyfrowanie WEP, WPA/WPA2 (PSK), WPA/WPA2-Enterprise, oraz filtrowanie MAC.</p>\r\n', '<p>Router bezprzewodowy z modemem 4G LTE/3G. Pracuje w standardach WiFi b/g/n. Posiada dwie zewnętrzne anteny modemu o mocy 2dBi,&nbsp;</p>\r\n', '<table align="left" border="1" cellpadding="0" cellspacing="0" style="width:500px">\r\n	<tbody>\r\n		<tr>\r\n			<td>Gwarancja</td>\r\n			<td>24 miesiące</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Załączone wyposażenie</td>\r\n			<td>Zasilacz</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Interfejs WAN</td>\r\n			<td>1x 10/100BaseTX (RJ45)</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Interfejs LAN</td>\r\n			<td>3x 10/100/1000BaseT (RJ45)</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Zabezpieczenia</td>\r\n			<td>WPA , WPA2 , WEP , WPA2-PSK , WPS , Filtrowanie adres&oacute;w MAC , WPA Enterprise , WPA2 Enterprise , DMZ</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Protokoły i standardy sieciowe</td>\r\n			<td>DHCP , IEEE 802.11b , IEEE 802.11g , IEEE 802.11n , WMM (Wi-Fi Multimedia) , IPv4 , UMTS , IPv6 , LTE</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Funkcje</p>\r\n			</td>\r\n			<td>NAT , DMZ , DHCP , WMM , NAPT</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Firewall</td>\r\n			<td>Tak</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n', '2016-08-18 12:48:30', 1, 0, 0, 1, 4, 'router', 8, 1),
(47, 'Router ASUS DSL-N12E', 153, 'ASUS', 'Router ASUS', 'Router ASUS DSL-N12E', '<ul>\n	<li><strong>Gwarancja: &nbsp; </strong>24 miesiące</li>\n	<li><strong>Załączone wyposażenie:</strong>&nbsp; Zasilacz , Płyta CD , Kabel RJ11 , Kabel RJ45</li>\n</ul>\n', 'router-4773.jpg', '<p>Router i modem ADSL ASUS DSL-N12E oferuje prędkość połączenia bezprzewodowego rzędu 300Mbit/s. Zastępuje modem ADSL dostawcy usług internetowych, pozwala oszczędzić miejsce i eliminuje bałagan</p>\r\n', '<p>&nbsp;&nbsp;&nbsp;&nbsp; Router i modem ADSL ASUS DSL-N12E oferuje prędkość połączenia bezprzewodowego rzędu 300Mbit/s. Zastępuje modem ADSL dostawcy usług internetowych</p>\r\n', '<table align="left" border="1" cellpadding="0" cellspacing="0" style="width:500px">\r\n	<tbody>\r\n		<tr>\r\n			<td>Interfejs WAN</td>\r\n			<td>1x RJ-11</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Interfejs LAN</td>\r\n			<td>4x 10/100BaseTX (RJ45)</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Antena</td>\r\n			<td>2x 2 dBi</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Przepustowość</td>\r\n			<td>300 Mbps</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Zabezpieczenia</td>\r\n			<td>64/128-bit WEP , WPA2-PSK , WPA-PSK , Filtrowanie adres&oacute;w MAC , Filtrowanie adres&oacute;w IP</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Protokoły routingu</td>\r\n			<td>RIP</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Protokoły i standardy sieciowe</td>\r\n			<td>IEEE 802.11b , IEEE 802.11g , IEEE 802.11n , IEEE 802.3 , IEEE 802.3u , IPv4 , QoS</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Zarządzanie i konfiguracja</td>\r\n			<td>Przeglądarka WWW</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n', '2016-08-18 12:57:33', 0, 1, 1, 1, 3, 'router', 8, 1),
(48, 'Router ZTE MF283+ LTE', 581, 'ZTE', 'Router ZTE MF283+ LTE', 'Router ZTE', '<ul>\r\n	<li>Gwarancja: &nbsp; 24 miesiące</li>\r\n	<li>Załączone wyposażenie:&nbsp; Zasilacz sieciowy</li>\r\n</ul>\r\n', 'router-4863.jpg', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ZTE MF283+ to zaawansowany technologicznie router działający w oparciu technologie 4G LTE CAT4, 3G DC-HSPA+ /HSPA/UMTS 900/2100M oraz 2G EDGE/GPRS/GSM. Urządzenie umożliwia dostęp do internetu mobilnego zar&oacute;wno za pośrednictwem sieci LAN jak i WIFI. Dodatkowo, ZTE MF283+ może r&oacute;wnież działać jako modem DSL oraz router bezprzewodowy. Sygnał WIFI może być dzielony pomiędzy wielu użytkownik&oacute;w jednocześnie. To co odr&oacute;żnia mf283+ od pozostałych router&oacute;w to możliwość bezpośredniego podłączenia telefonu analogowego.<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Zarządzanie routerem jest proste i odbywa się z poziomu przeglądarki internetowej. W przypadku, kiedy pojawią się utrudnienia w dostępie do sieci mobilnej, do urządzenia można zamontować dwie dodatkowe anteny zewnętrzne. ZTE MF283+ świetnie sprawdzi się zar&oacute;wno w firmie jak i w domu.&nbsp;</p>\r\n', '<p>ZTE MF283+ to zaawansowany technologicznie router działający w oparciu technologie 4G LTE CAT4, 3G DC-HSPA+ /HSPA/UMTS 900/2100M oraz 2G EDGE/GPRS/GSM.</p>\r\n', '<table align="left" border="1" cellpadding="0" cellspacing="0" style="width:500px">\r\n	<tbody>\r\n		<tr>\r\n			<td>Zastosowane technologie</td>\r\n			<td>WPS</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Przeznaczenie</td>\r\n			<td>XDSL (sieci lokalne; telewizja kablowa) , 4G LTE (kom&oacute;rkowe sieci telefoniczne)</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Antena</td>\r\n			<td>2x wewnętrzna</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Porty pozostałe</td>\r\n			<td>1x SIM , 2x FXS (RJ-11)</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Diody sygnalizacyjne</td>\r\n			<td>Wi-Fi , Zasilanie , Siła sygnału , Phone , 3G/4G</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Obsługa sieci bezprzewodowej</td>\r\n			<td>Tak</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Interfejs WAN</td>\r\n			<td>1x 10/100BaseTX (RJ45) WAN/LAN</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Interfejs LAN</td>\r\n			<td>3x 10/100BaseTX (RJ45)</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Przepustowość</td>\r\n			<td>150 Mbps</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Złącze USB</td>\r\n			<td>1xUSB</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n', '2016-08-18 13:06:43', 1, 0, 0, 1, 2, 'router', 9, 1),
(49, 'Router LINKSYS XAC1900-EK', 799, 'CISCO\n', 'Router LINKSYS XAC1900-EK', 'Router LINKSYS ', '<ul>\r\n	<li><strong>Gwarancja</strong>:&nbsp; 24 miesiące</li>\r\n	<li><strong>Załączone wyposażenie</strong>: Płyta CD-ROM z instrukcją i sterownikami , Kabel Ethernet</li>\r\n</ul>\r\n', 'router-4959.jpg', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Bezprzewodowy router do sieci ADSL2+ i kablowych umożliwiający bezprzewodowe i przewodowe podłączenie komputer&oacute;w. Router jest zgodny ze standardem IEEE 802.11a/b/g/n/ac. Urządzenie wyposażone jest r&oacute;wnież w cztery porty 10/100/1000 BaseTX (RJ45), do kt&oacute;rych można podłączać komputery PC lub inne urządzenia z kartą sieciową Ethernet. Zaawansowane funkcje bezpieczeństwa takie jak szyfrowanie WPA2 czy WEP pomagają skutecznie zabezpieczyć sieć.</p>\r\n', '<p>Bezprzewodowy router do sieci ADSL2+ i kablowych umożliwiający bezprzewodowe i przewodowe podłączenie komputer&oacute;w.</p>\r\n', '<table align="left" border="1" cellpadding="0" cellspacing="0" style="width:500px">\r\n	<tbody>\r\n		<tr>\r\n			<td>Przeznaczenie</td>\r\n			<td>ADSL2+</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Interfejs WAN</td>\r\n			<td>1x RJ-45</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Interfejs LAN</td>\r\n			<td>4x 10/100/1000BaseT (RJ45)</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Porty pozostałe</td>\r\n			<td>1x USB 2.0 , 1x USB 3.0</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Diody sygnalizacyjne</td>\r\n			<td>Wi-Fi , Zasilanie , Internet</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Obsługa sieci bezprzewodowej</td>\r\n			<td>Tak</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Przepustowość</td>\r\n			<td>1300 Mbps</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Protokoły i standardy sieciowe</td>\r\n			<td>IEEE 802.11b , IEEE 802.11g , IEEE 802.11n , IEEE 802.11a , IEEE 802.11ac</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n', '2016-08-18 13:12:43', 0, 1, 0, 1, 2, 'router', 12, 1),
(50, 'Router ACTINA P6800', 60, 'ACTINA', 'Router ACTINA P6800', 'Router ACTINA ', '<ul>\r\n	<li><strong>Gwarancja</strong>:&nbsp; 12 miesiące</li>\r\n	<li><strong>Załączone wyposażenie</strong>: Płyta CD-ROM z instrukcją i sterownikami , Kabel Ethernet</li>\r\n</ul>\r\n', 'router-5066.jpg', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; CERBERUS P 6800 to proste w konfiguracji urządzenie zaprojektowane do szybkiej instalacji na mniejszych powierzchniach. Router WiFi zgodny jest ze standardem 802.11 n, kt&oacute;ry zapewnia prędkość transmisji do 300Mbps. Zaawansowane zabezpieczenia WPA/WPA2 chronią sieć przed zagrożeniami. P 6800 może pracować jako Access Point, eliminując martwe punkty Twojej sieci.</p>\r\n', '<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Router ACTINA P6800&nbsp;CERBERUS P 6800 to proste w konfiguracji urządzenie zaprojektowane do szybkiej instalacji na mniejszych powierzchniach.</p>\r\n', '<table align="left" border="1" cellpadding="0" cellspacing="0" style="width:500px">\r\n	<tbody>\r\n		<tr>\r\n			<td>Interfejs WAN</td>\r\n			<td>1x RJ-45</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Interfejs LAN</td>\r\n			<td>3x 10/100BaseTX (RJ45)</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Obsługa sieci bezprzewodowej</td>\r\n			<td>Tak</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Przepustowość</td>\r\n			<td>300 Mbps</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Zabezpieczenia</td>\r\n			<td>WEP , WPA2-PSK , WPA-PSK , Filtrowanie adres&oacute;w MAC , Filtrowanie adres&oacute;w URL , Filtrowanie port&oacute;w</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Protokoły i standardy sieciowe</td>\r\n			<td>PPTP , DHCP , L2TP , IEEE 802.11b , IEEE 802.11g , IEEE 802.11n , PPPoE , IEEE 802.11b/g/n 2.4GHz</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n', '2016-08-18 13:17:54', 1, 0, 0, 1, 2, 'router', 10, 1),
