(52, 'Router ACTINA P6820', 208, 'ACTINA', 'Router ACTINA P6820', 'Router ACTINA', '<ul>\r\n	<li><strong>Gwarancja</strong>:&nbsp; 24 miesiące</li>\r\n	<li><strong>Załączone wyposażenie</strong>: Płyta CD-ROM z instrukcją i sterownikami , Kabel Ethernet</li>\r\n</ul>\r\n', 'router-5278.jpg', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Cerberus P 6820 to DualBandowy router 5-tej generacji, kt&oacute;ry pozwala na przesyłanie danych z prędkością 1200Mbps. Sieć P 6820 jest komatybilna wstecz, dzięki czemu bez problemu połączysz się z urządzeniami pracującymi w standardzie WiFi b/g/n.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Router został wyposażony w 4 wewnętrzne anteny o mocy 5dBi, takie rozwiązanie umożliwia wzmocnienie jakości sygnału. Dzięki P6820 streamowanie film&oacute;w HD nie powinno już stanowić najmniejszego problemu.</p>\r\n', '<p>&nbsp;</p>\r\n\r\n<p>Router ACTINA P6820&nbsp;Cerberus P 6820 to DualBandowy router 5-tej generacji, kt&oacute;ry pozwala na przesyłanie danych z prędkością 1200Mbps.</p>\r\n', '<table align="left" border="1" cellpadding="0" cellspacing="0" style="width:500px">\r\n	<tbody>\r\n		<tr>\r\n			<td>Interfejs WAN</td>\r\n			<td>1x RJ-45</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Interfejs LAN</td>\r\n			<td>4x 10/100BaseTX (RJ45)</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Porty pozostałe</td>\r\n			<td>Nie</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Diody sygnalizacyjne</td>\r\n			<td>Tak</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Obsługa sieci bezprzewodowej</td>\r\n			<td>Tak</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Przepustowość</td>\r\n			<td>300 Mbps</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Antena</td>\r\n			<td>2x 5 dBi</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Zastosowane technologie</td>\r\n			<td>WPS , 64/128-bit WEP , WPA2-PSK , WPA-PSK</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Zabezpieczenia</td>\r\n			<td>WEP , WPA2-PSK , WPA-PSK , Filtrowanie adres&oacute;w MAC , Filtrowanie adres&oacute;w URL , Filtrowanie port&oacute;w</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Protokoły i standardy sieciowe</td>\r\n			<td>PPTP , DHCP , L2TP , IEEE 802.11b , IEEE 802.11g , IEEE 802.11n , IEEE 802.3u , PPPoE , IEEE 802.11b/g/n 2.4GHz</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n', '2016-08-18 13:36:14', 1, 0, 1, 1, 2, 'router', 10, 1),
(53, 'Router ASUS RT-N12', 111, 'ASUS', 'Router ASUS RT-N12', 'Router ASUS', '<ul>\r\n	<li><strong>Gwarancja</strong>:&nbsp; 24 miesiące</li>\r\n	<li><strong>Załączone wyposażenie</strong>: Płyta CD-ROM z instrukcją i sterownikami , Kabel Ethernet</li>\r\n</ul>\r\n', 'router-5374.jpg', '<p><strong>Super szybki router bezprzewodowy:</strong></p>\r\n\r\n<p>-Prędkość transferu danych SuperSpeedN do 300Mbps, umożliwiająca nieprzerwane strumieniowanie plik&oacute;w multimedialnych.<br />\r\n-Technologia Broadcom Accelerange&trade; dostarczająca 450%owe* pokrycie sygnałem.<br />\r\n-Instalacja bez płyty CD, zarządzanie bez instrukcji<br />\r\n-4 sieci w 1: Dodatkowa sieć umożliwiająca przydzielanie przepustowości oraz kontrolę dostępu.<br />\r\n-EZ Switch: Przełącz tryb urządzenia jednym dotknięciem 30,000 sesji umożliwiających stabilny transfer P2P</p>\r\n\r\n<p><strong>EZ Switch &ndash; przełącz tryb urządzenia jednym przyciskiem</strong></p>\r\n\r\n<p>Opracowany przez firmę ASUS EZ Switch umożliwia działanie w trzech trybach, kt&oacute;re użytkownik może bardzo łatwo zmieniać, wystarczy JEDNO DOTKNIĘCIE.</p>\r\n\r\n<p><strong>QIS(Quick Internet Setup) - 3 kroki łączenia z Internetem</strong></p>\r\n\r\n<p>Wystarczy podłączyć dowolne urządzenie sieciowe do routera bezprzewodowego, a kreator QIS szybko poprowadzi użytkownika przez wszystkie kroki łączenia z Internetem.</p>\r\n\r\n<p><strong>EZQoS - Quality of Service</strong></p>\r\n\r\n<p>Dzięki unikatowemu silnikowi EZQoS firmy ASUS, użytkownicy mogą bardzo łatwo przydzielać przepustowość w zależności od indywidualnych potrzeb. Wystarczy nacisnąć odpowiedni guzik, na przykład &lsquo;gra&rsquo;, i przydzielić większą lub mniejszą przepustowość konkretnym funkcjom sieciowym (FTP, gry, P2P), zapewniając im odpowiednie działanie.</p>\r\n\r\n<p><strong>Mapa sieci &ndash; zarządzanie bez instrukcji obsługi</strong></p>\r\n\r\n<p>Proste rozwiązanie, kt&oacute;re pozwala użytkownikom:</p>\r\n\r\n<p>-Wyświetlić status całej sieci WAN/LAN<br />\r\n-Bezpiecznie połączyć się z siecią bezprzewodową i uniemożliwić korzystanie z niej intruzom<br />\r\n-Szybko i łatwo zarządzać siecią<br />\r\n-Wypr&oacute;bować nasze oprogramowanie EZ UI</p>\r\n', '<p>&nbsp;</p>\r\n\r\n<p>Super szybki router bezprzewodowy:&nbsp;-Prędkość transferu danych SuperSpeedN do 300Mbps,</p>\r\n', '', '2016-08-18 13:39:08', 0, 0, 1, 1, 3, 'router', 8, 1),
(54, 'Router EDIMAX BR-6228nC', 70, 'EDIMAX', 'Router EDIMAX BR-6228nC', 'Router EDIMAX', '<ul>\r\n	<li><strong>Gwarancja</strong>:&nbsp; 24 miesiące</li>\r\n	<li><strong>Załączone wyposażenie</strong>: Płyta CD-ROM z instrukcją i sterownikami , Kabel Ethernet</li>\r\n</ul>\r\n', 'router-5435.jpg', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; BR-6228nC jest rozwiązaniem idealnym dla domu lub małego biura. Router do sieci kabel/DSL oraz 3G, umożliwia przewodowe i bezprzewodowe podłączenie komputer&oacute;w do tego samego łącza internetowego. Urządzenie wyposażone jest w jeden port WAN RJ-45, cztery porty LAN RJ-45 10/100Base-TX. BR-6228nC jest zgodny ze standardem 802.11b/g, jest ponadto kompatybilny ze standardem IEEE 802.11n.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Urządzenia kompatybilne ze standardem 802.11n mogą uzyskać prędkość transmisji nawet do 150Mb/s. Urządzenie ma wbudowane 4 MB pamięci Flash oraz 16 MB SDRAM. Router BR-6228nC wykorzystuje najnowszą ekologiczną technologię. Dzięki wykrywaniu obciążenia sieci bezprzewodowej i dostosowywaniu do niego mocy nadajnika, router pozwala zaoszczędzić do 74% energii przy zachowaniu najwyższej jakości transmisji bezprzewodowej.</p>\r\n', '<p>&nbsp;</p>\r\n\r\n<p>Router przeznaczony do sieci kabel/DSL oraz 3G. Posiada jeden port WAN RJ-45, cztery porty LAN RJ-45 10/100Base-TX.</p>\r\n', '<table align="left" border="1" cellpadding="0" cellspacing="0" style="width:500px">\r\n	<tbody>\r\n		<tr>\r\n			<td>Interfejs WAN</td>\r\n			<td>1x RJ-45</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Interfejs LAN</td>\r\n			<td>1x 10/100BaseTX (RJ45)</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Porty pozostałe</td>\r\n			<td>Nie</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Diody sygnalizacyjne</td>\r\n			<td>Tak</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Obsługa sieci bezprzewodowej</td>\r\n			<td>Tak</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Przepustowość</td>\r\n			<td>300 Mbps</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Antena</td>\r\n			<td>2x 5 dBi</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Zastosowane technologie</td>\r\n			<td>WPS , 64/128-bit WEP , WPA2-PSK , WPA-PSK</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Zabezpieczenia</td>\r\n			<td>WEP , WPA2-PSK , WPA-PSK , Filtrowanie adres&oacute;w MAC , Filtrowanie adres&oacute;w URL , Filtrowanie port&oacute;w</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Protokoły i standardy sieciowe</td>\r\n			<td>PPTP , DHCP , L2TP , IEEE 802.11b , IEEE 802.11g , IEEE 802.11n , IEEE 802.3u , PPPoE , IEEE 802.11b/g/n 2.4GHz</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n', '2016-08-18 13:44:16', 1, 1, 1, 1, 2, 'router', 11, 1),
(55, 'Router ASUS DSL-N66U', 599, 'ASUS', 'Router ASUS DSL-N66U', 'Router ASUS', '<ul>\r\n	<li><strong>Gwarancja</strong>:&nbsp; 24 miesiące</li>\r\n	<li><strong>Załączone wyposażenie</strong>:&nbsp; instrukcją i sterownikami , Kabel Ethernet</li>\r\n</ul>\r\n', 'router-5557.jpg', '<p>- Jednoczesna transmisja na częstotliwościach 2.4 GHz oraz 5 GHz, silny sygnał i bardzo szybkie połączenie do 900Mbps<br />\r\n- Porty Gigabit Ethernet zapewniające najszybszą i najbardziej niezawodną łączność<br />\r\n- Download Master umożliwiapobieranie plik&oacute;w na urządzenia magazynujące podłączone do routera przez port USB<br />\r\n- Interfejs ASUSWRT umożliwia szybkie tworzenie sieci, monitorowanie sygnału i kontrolę aplikacji sieciowych<br />\r\n- Osobne, bezpieczne sieci dla gości</p>\r\n', '<p>Jednoczesna transmisja na częstotliwościach 2.4 GHz oraz 5 GHz, silny sygnał i bardzo szybkie połączenie do 900Mbps<br />\r\n- Porty Gigabit Ethernet zapewniające najszybszą i najbardziej niezawodną łączność</p>\r\n', '<table align="left" border="1" cellpadding="0" cellspacing="0" style="width:500px">\r\n	<tbody>\r\n		<tr>\r\n			<td>Interfejs WAN</td>\r\n			<td>1x 10/100/1000BaseT (RJ45) , 1x RJ-11</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Interfejs LAN</td>\r\n			<td>4x 10/100/1000BaseT (RJ45)</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Porty pozostałe</td>\r\n			<td>Nie</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Diody sygnalizacyjne</td>\r\n			<td>Tak</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Obsługa sieci bezprzewodowej</td>\r\n			<td>Tak</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Przepustowość</td>\r\n			<td>300 Mbps</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Funkcje</td>\r\n			<td>VPN</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Zastosowane technologie</td>\r\n			<td>WPS , 64/128-bit WEP , WPA2-PSK , WPA-PSK</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Zabezpieczenia</td>\r\n			<td>WEP , WPA2-PSK , WPA-PSK , Filtrowanie adres&oacute;w MAC , Filtrowanie adres&oacute;w URL , Filtrowanie port&oacute;w</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Protokoły i standardy sieciowe</td>\r\n			<td>PPTP , DHCP , L2TP , IEEE 802.11b , IEEE 802.11g , IEEE 802.11n , IEEE 802.3u , PPPoE , IEEE 802.11b/g/n 2.4GHz</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n', '2016-08-18 13:49:56', 0, 0, 1, 1, 0, 'router', 8, 1);
INSERT INTO `table_products` (`products_id`, `title`, `price`, `model`, `seo_words`, `seo_description`, `mini_description`, `image`, `description`, `mini_features`, `features`, `datetime`, `new`, `leader`, `sale`, `visible`, `count`, `type_product`, `model_id`, `yes_like`) VALUES
(56, 'ROUTER TP-LINK TL-WR702N', 77, 'TP-LINK', 'ROUTER TP-LINK TL-WR702N', 'ROUTER TP-LINK', '<ul>\r\n	<li><strong>Gwarancja</strong>:&nbsp; 24 miesiące</li>\r\n	<li><strong>Załączone wyposażenie</strong>: Płyta CD-ROM z instrukcją i sterownikami , Kabel Ethernet</li>\r\n</ul>\r\n', 'router-5631.jpg', '<p><strong>Zastosowanie produktu</strong><br />\r\nRouter TL-WR702N przeznaczony jest do połączeń z tabletami, smartfonami, przenośnymi konsolami do gier i innymi przenośnymi urządzeniami bezprzewodowymi. Urządzenie, zasilane za pomocą zewnętrznego zasilacza lub połączenia z komputerem poprzez kabel USB, umożliwia wygodne łączenie z Internetem i wsp&oacute;łdzielenie połączenia w średniej wielkości pomieszczeniu przy prędkości do 150Mbps. Urządzenie jest idealne do użytkowania w podr&oacute;ży dzięki swoim miniaturowym rozmiarom i jest wystarczające do praktycznie wszystkich podstawowych zastosowań bezprzewodowych.<br />\r\n&nbsp;<br />\r\n<strong>Przenośny i kompaktowy - idealny do użytkowania w domu i w podr&oacute;ży</strong><br />\r\nTL-WR702N jest najmniejszym na świecie bezprzewodowym routerem. Jest r&oacute;wnież bardzo łatwy w użytkowaniu. Aby utworzyć bezprzewodowy punkt dostępowy w pokoju podr&oacute;żny musi tylko podłączyć kabel WAN w pokoju hotelowym do portu w routerze i wpisać domyślne hasło.<br />\r\n<br />\r\n<strong>Wygodne zasilanie - łatwe do użytkowania w podr&oacute;ży</strong><br />\r\nRouter TL-WR702N wyposażony jest w port mikro-USB i może być zasilany za pomocą zewnętrznego zasilacza lub połączenia USB z komputerem. W podr&oacute;ży użytkownik musi tylko podłączyć router TL-WR702N do portu USB w komputerze aby m&oacute;c dzielić połączenie bezprzewodowe z rodziną i przyjaci&oacute;łmi.<br />\r\n<br />\r\n<strong>Wiele tryb&oacute;w działania urządzenia</strong><br />\r\nRouter TL-WR702N może działać w trybie AP, routera, bridge, klienta oraz repeatera w celu zapewnienia użytkownikom jak największej ilości możliwych zastosowań.<br />\r\n&nbsp;<br />\r\n<strong>Zaawansowane zabezpieczenia</strong><br />\r\nRouter TL-WR702N wspiera szyfrowanie WPA-PSK/WPA2-PSK zapewniające skuteczną ochronę sieci bezprzewodowych. Ochrona ta jest jeszcze skuteczniejsza dzięki domyślnie włączonym zabezpieczeniom sieci bezprzewodowej.</p>\r\n', '<p>Router TP-LINK TL-WR702N&nbsp;Zastosowanie produktuRouter TL-WR702N przeznaczony jest do połączeń z tabletami, smartfonami, przenośnymi konsolami do gier i innymi przenośnymi urządzeniami</p>\r\n', '<table align="left" border="1" cellpadding="0" cellspacing="0" style="width:500px">\r\n	<tbody>\r\n		<tr>\r\n			<td>Interfejs WAN</td>\r\n			<td>1x 10/100BaseTX (RJ45)</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Interfejs LAN</td>\r\n			<td>1x 10/100BaseTX (RJ45)</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Porty pozostałe</td>\r\n			<td>1x microUSB</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Diody sygnalizacyjne</td>\r\n			<td>Tak</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Obsługa sieci bezprzewodowej</td>\r\n			<td>Tak</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Przepustowość</td>\r\n			<td>300 Mbps</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Antena</td>\r\n			<td>Wewnętrzna</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Zastosowane technologie</td>\r\n			<td>WPS , 64/128-bit WEP , WPA2-PSK , WPA-PSK</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Zabezpieczenia</td>\r\n			<td>WEP , WPA2-PSK , WPA-PSK , Filtrowanie adres&oacute;w MAC , Filtrowanie adres&oacute;w URL , Filtrowanie port&oacute;w</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Protokoły i standardy sieciowe</td>\r\n			<td>IEEE 802.11b , IEEE 802.11g , IEEE 802.11n</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n', '2016-08-18 13:55:16', 1, 0, 0, 1, 0, 'router', 3, 1),
(57, 'Router ZTE MF910 LTE Mobilny', 449, 'ZTE', 'Router ZTE MF910 LTE Mobilny', 'Router ZTE', '<ul>\r\n	<li><strong>Gwarancja</strong>:&nbsp; 24 miesiące</li>\r\n	<li><strong>Załączone wyposażenie</strong>: Płyta CD-ROM z instrukcją i sterownikami , Kabel Ethernet</li>\r\n</ul>\r\n', 'router-5741.jpg', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ZTE MF910 to kieszonkowy router 4G LTE ważący jedynie 106 gr. Urządzenie oparte na procesorze Qualcomm MDM9225 z rodziny Cortex w pełni wspieraLTE kategorii 4 zar&oacute;wno w technologii FDD jak i TDD. Router wyposażony jest w czytelny, kolorowy wyświetlacz o rozdzieczlości 128&times;128 px informujący o aktualnym stanie urządzenia.<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Z routera MF910 może korzytać nawet 14 podłączonych urządzeń jednocześnie. Dzięki nowoczesnej technologii można pobierać dane z prędkością 150 Mb/s i wysyłać z prędkością 50 Mb/s. Router posiada baterię o mocy 2300 mAh, dzięki kt&oacute;rej będzie można surfować po internecie przez 8 godzin. W stanie czuwania może pozostać przez długie 150 godzin. ZTE MF910 działa w pasmach LTE 800/900/1800/2600Mhz oraz obsługuje transmisje danych w częstotliwościach UMTS/3G jak i 2G GSM/EDGE, dzięki czemu można z niego korzystać praktycznie na całym świecie, wymieniając jedynie kartę SIM na lokalną.</p>\r\n', '<p>&nbsp;</p>\r\n\r\n<p>Mobilny router ZTE MF910 pozwala pobierać dane z prędkością 150 Mb/s. Router posiada baterię o pojemności 2300 mAh, dzięki kt&oacute;rej</p>\r\n', '<table align="left" border="1" cellpadding="0" cellspacing="0" style="width:500px">\r\n	<tbody>\r\n		<tr>\r\n			<td>Przeznaczenie</td>\r\n			<td>4G LTE (kom&oacute;rkowe sieci telefoniczne)</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Antena</td>\r\n			<td>Wewnętrzna</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Protokoły i standardy sieciowe</td>\r\n			<td>IEEE 802.11b , IEEE 802.11g , IEEE 802.11n , IEEE 802.11a , UMTS , EDGE , GSM , LTE</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Porty pozostałe</td>\r\n			<td>1x SIM</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Przepustowość</td>\r\n			<td>150 Mbps</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n', '2016-08-18 14:03:04', 1, 0, 0, 1, 0, 'router', 9, 1),
