(62, 'Przewód teleinformatyczny F/UTP kat.5e PVC KIF5PVC305 A-lan', 123, 'kat.5E', 'Przewód teleinformatyczny F/UTP', 'kat.5e', '<p>&bull; żyły miedziane jednodrutowe o średnicy 0,51mm (24AWG)<br />\r\n&bull; izolacja polietylenowa<br />\r\n&bull; ośrodek izolowany folią estrofolową i ekranowany folią Al/PET<br />\r\n&bull; pod ekranem żyła uziemiająca Cu fi 0,4mm<br />\r\n&bull; powłoka polwinit o podwyższonym indeksie tlenowym (FR-PVC)<br />\r\n&bull; kolor powłoki szary</p>\r\n', 'cable-6297.jpg', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Przew&oacute;d teleinformatyczny kat.5e PVC KIF5PVC305; 4 wiązki parowe skręcone razem z żył Cu jednodrutowych o średnicy 0,51mm, ośrodek izolowany folią estrofolową i ekranowany folią Al/PET; powłoka polwinitowa o podwyższonym indeksie tlenowym<br />\r\n<br />\r\n<strong>Przeznaczenie:</strong><br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Przew&oacute;d ekranowany F/UTP kat.5e 4x2x0,5 jest przeznaczony do wykonywania instalacji wewnętrznych poziomych i pionowych w sieciach teleinformatycznych szczeg&oacute;lnie narażonych na wpływ zakł&oacute;ceń elektromagnetycznych. Tory kabli kategorii 5e przewidziane są do pracy przy częstotliwościach do 100MHz, z przepływnością binarną do 1Gb/s.<br />\r\nKable F/UTP 4x2x0,5 nie mogą być stosowane do zasilania urządzeń elektroenergetycznych.<br />\r\nKable są przeznaczone do pracy w otoczeniu o temperaturze od -20 do +50st.C.</p>\r\n', '<p>Przew&oacute;d teleinformatyczny kat.5e PVC KIF5PVC305; 4 wiązki parowe skręcone razem z żył</p>\r\n', '<p>&bull; żyły miedziane jednodrutowe o średnicy 0,51mm (24AWG)<br />\r\n&bull; izolacja polietylenowa<br />\r\n&bull; ośrodek izolowany folią estrofolową i ekranowany folią Al/PET<br />\r\n&bull; pod ekranem żyła uziemiająca Cu fi 0,4mm<br />\r\n&bull; powłoka polwinit o podwyższonym indeksie tlenowym (FR-PVC)<br />\r\n&bull; kolor powłoki szary<br />\r\n&bull; minimalny promień zginania 4xśrednica</p>\r\n', '2016-08-18 16:41:57', 1, 0, 1, 1, 2, 'cable', 15, 1),
(63, 'Przewód teleinformatyczny U/UTP kat.5e PVC SEC5EUTP SecurityNET', 5, 'kat.5E', ' kat.5e ', 'Przewód teleinformatyczny U/UTP kat.5e', '<p>&bull; Żyły miedziane jednodrutowe o średnicy 0.5mm<br />\r\n&bull; Izolacja polietylenowa HDPE: 0.88mm<br />\r\n&bull; Ośrodek: 4 pary skręcone<br />\r\n&bull; Powłoka polwinitowa grubości: 0.5mm<br />\r\n&bull; Średnica zewnętrzna powłoki: 5,00mm</p>\r\n', 'cable-6312.jpg', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Kabel teleinformatyczny U/UTP kat.5e SecurityNET PVC 4x2x0.5 może być stosowany w łączach telekomunikacyjnych oraz sieciach komputerowych ethernet. Ten kabel teleinformatyczny może być stosowany przy przesyłaniu danych zar&oacute;wno w postaci analogowej, jak i cyfrowej. Jest to kabel teleinformatyczny skrętkowy nieekranowany przeznaczony do stosowania wewnąttrz pomieszczeń.<br />\r\nKabel ethernetowy nieekranowany U/UTP kat.5e SecurityNET PVC 4x2x0.5 jest przeznaczony do wykonywania instalacji wewnętrznych poziomych i pionowych w sieciach teleinformatycznych, komputerowych, telefonicznych, systemach CCTV itp., kt&oacute;re nie są narażone na zakł&oacute;cenia elektromagnetyczne.<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Przew&oacute;d teleinformatyczny U/UTP kat.5e domNET PVC 4x2x0.5 może być z powodzeniem stosowany do wykonywania połączeń pomiędzy punktami dystrybucyjnymi sygnał&oacute;w multimedialnych, a gniazdami przyłączeniowymi poszczeg&oacute;lnych użytkownik&oacute;w.<br />\r\nKabel ethernetowy nieekranowany U/UTP kat.5e SecurityNET PVC 4x2x0.5 nie może być stosowany do zasilania urządzeń elektroenergetycznych.<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Kabel spełnia wymagania norm okablowania strukturalnego: ISO/IEC 11801, EN 50173, EIA/TIA 568-B.2.</p>\r\n', '<p>Przew&oacute;d teleinformatyczny U/UTP kat.5e PVC SecurityNET; 4 wiązki parowe skręcone razem z żył</p>\r\n', '<p>&bull; Żyły miedziane jednodrutowe o średnicy 0.5mm<br />\r\n&bull; Izolacja polietylenowa HDPE: 0.88mm<br />\r\n&bull; Ośrodek: 4 pary skręcone<br />\r\n&bull; Powłoka polwinitowa grubości: 0.5mm<br />\r\n&bull; Średnica zewnętrzna powłoki: 5,00mm<br />\r\n&bull; Impedancja w zakresie 1&divide;100MHz: 100Ohm<br />\r\n&bull; Maksymalna rezystancja w zakresie 1&divide;100MHz: 9.5(Ohm/100m)<br />\r\n&bull; Propagacja sygnału NVP: 69%<br />\r\n&bull; Rozrzut op&oacute;źnienia Delay Skew: nie więcej niż 45 (ns/100m)<br />\r\n&bull; Kolor powłoki biały<br />\r\n&bull; Zgodność z normami okablowania strukturalnego: ISO/IEC 11801, EN 50173, EIA/TIA 568-B.2</p>\r\n', '2016-08-18 17:24:59', 1, 1, 0, 1, 1, 'cable', 15, 1),
