(76, 'WTYK RJ 11 6P4C DRUT', 9, 'Wtyczki', 'WTYK RJ 11 ', 'WTYK RJ 11 ', '<p><strong>Fabrycznie nowe, wysokiej jakości końc&oacute;wki - wtyki RJ11 6p4c&nbsp; komplet 100&nbsp; szt.</strong><strong> Gwarancja 2 lata</strong></p>\r\n', 'acces-7672.jpg', '<ul>\r\n	<li><strong>Wtyczki są stosowane m.in. w telefonicznych przewodach czterożyłowych</strong></li>\r\n	<li><strong>Każdy pin pokryty warstwą 3 mikrometr&oacute;w czystego złota (przeciwutleniacz)</strong></li>\r\n	<li><strong>Najbardziej rozpowszechnione jako podstawowe złącze do budowy przewodowych sieci telefonicznych</strong></li>\r\n	<li><strong>Końc&oacute;wki wykonane są z wytrzymałego plastiku - przezroczyste</strong></li>\r\n</ul>\r\n', '<p><strong>Fabrycznie nowe, wysokiej jakości końc&oacute;wki - wtyki RJ11 6p4c&nbsp; komplet 100&nbsp; szt.</strong><strong> Gwarancja 2 lata</strong></p>\r\n', '<table align="left" border="1" cellpadding="0" cellspacing="0" style="width:500px">\r\n	<tbody>\r\n		<tr>\r\n			<td><strong>Algorytm szyfrowania</strong></td>\r\n			<td>LEAP, DES, Triple DES, MD5, TLS, PEAP, TTLS, TKIP, WPA, WPA2, WPA-PSK, PKI, 128-bit AES, 192-bit AES, 256-bit AES</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Metoda uwierzytelniania</strong></td>\r\n			<td>RADIUS, TACACS+</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Cechy</strong></td>\r\n			<td>Autowykrywanie urządzenia, NAT, VLAN, auto-uplink (auto MDI/MDI-X), Stateful Packet Inspection (SPI), Filtrowanie adres&oacute;w MAC, Class-Based Wagaed Fair Queuing (CBWFQ), Wagaed Fair Queuing (WFQ), Access Control List (ACL), Quality of Service (QoS), DHCP server, DNS proxy</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Zgodność z normami</strong></td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>RAM</strong></td>\r\n			<td>512 MB (zainstalowany) / 768 MB (maks.) - DDR2 SDRAM - SO-DIMM 200-pin</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Flash</strong></td>\r\n			<td>256 MB</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Interfejsy</strong></td>\r\n			<td>LAN : 4 porty 10Base-T/100Base-TX RJ-45<br />\r\n			WAN : 1 port 10Base-T/100Base-TX RJ-45<br />\r\n			Zarządzanie : 1 port konsolowy RJ-45<br />\r\n			USB : 1 port 4 PIN USB Typ A</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Zastosowane technologie</td>\r\n			<td>WPS , 64/128-bit WEP , WPA2-PSK , WPA-PSK</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Sloty</strong></td>\r\n			<td>1 og&oacute;łem / 1 wolny slot na ExpressCard<br />\r\n			1 og&oacute;łem / 1 wolny slot na SO-DIMM 200-pin</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Zasilacz</strong></td>\r\n			<td>Zasilacz zewnętrzny - 60 Watt</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n', '2016-08-18 19:50:28', 0, 0, 1, 1, 1, 'acces', 17, 1),
(77, 'WTYK RJ 45 8P8C CAT.5E DRUT', 18, 'Wtyczki', 'WTYK RJ 45 8P8C CAT.5E DRUT ', 'WTYK RJ 45 8P8C CAT.5E DRUT ', '<ul>\r\n	<li>Ośmiostykowe standardowe złącze używane najczęściej do zakończenia przewod&oacute;w typu &quot;skrętka&quot; (UTP, STP, itp.)</li>\r\n	<li>Najbardziej rozpowszechnione jako podstawowe złącze do budowy przewodowych sieci komputerowych w standardzie Ethernet.</li>\r\n	<li>Końc&oacute;wki wykonane są z wytrzymałego plastiku - przezroczyste.</li>\r\n</ul>\r\n', 'acces-7793.jpg', '', '<ul>\r\n	<li>Fabrycznie nowe, wysokiej jakości końc&oacute;wki - wtyki RJ45</li>\r\n	<li>Paczka zawiera 100 sztuk.</li>\r\n</ul>\r\n', '', '2016-08-18 20:01:02', 0, 0, 1, 1, 2, 'acces', 17, 1),
(78, 'WTYK RJ 45 8P8C CAT.6 DRUT', 24, 'Wtyczki', 'WTYK RJ 45 8P8C CAT.6 DRUT', 'WTYK RJ 45 8P8C CAT.6 DRUT', '<ul>\r\n	<li>Najbardziej rozpowszechnione jako podstawowe złącze do budowy przewodowych sieci komputerowych w standardzie Ethernet.</li>\r\n	<li>Końc&oacute;wki wykonane są z wytrzymałego plastiku - przezroczyste.</li>\r\n</ul>\r\n', 'switch-7874.jpg', '<ul>\r\n	<li>Fabrycznie nowe, wysokiej jakości końc&oacute;wki - wtyki RJ45 Cat6</li>\r\n</ul>\r\n', '<p>Ośmiostykowe standardowe złącze używane najczęściej do zakończenia przewod&oacute;w typu &quot;skrętka&quot; (UTP, STP, itp.)</p>\r\n', '', '2016-08-18 20:07:34', 1, 0, 1, 1, 2, 'switch', 17, 1),
(79, 'Profesjonalna zaciskarka do kabli RJ-45, RJ-12, RJ-11', 71, 'Zaciskacze', 'Profesjonalna zaciskarka do kabli RJ-45, RJ-12, RJ-11', 'Profesjonalna zaciskarka ', '<ul>\r\n	<li>Cięcie oraz ściąganie izolacji kabla w jednej opcji</li>\r\n	<li>Funkcjonalność dla 8P/RJ-45 oraz 6P/RJ-12, RJ-11</li>\r\n	<li>Stalowa konstrukcja dla długotrwałej trwałości</li>\r\n</ul>\r\n', 'acces-7979.jpg', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Dla Twoich zr&oacute;żnicowanych potrzeb przy sieciach, TRENDnet oferuje narzędzie specjalnie stworzone dla skompletowania akcesori&oacute;w sieciowych. Nasza profesjonalna zaciskarka do kabli TC-CT68 zaciska, ściąga izolacje oraz tnie kable dla 8 oraz 6 pozycyjnych wtyk&oacute;w modularnych. Zaciskarka do kabli kt&oacute;rą oferujemy jest łatwa do użycia oraz jest niezastąpiona w sytuacjach kiedy potrzebne jest ucięcie przewodu. Nasza profesjonalna zaciskarka do kabli zapewnia wygodę i bardzo konkurencyjną cenę.</p>\r\n', '<p>Dla Twoich zr&oacute;żnicowanych potrzeb przy sieciach, TRENDnet oferuje narzędzie specjalnie stworzone dla skompletowania akcesori&oacute;w sieciowych.</p>\r\n', '<ul>\r\n	<li>Zaciskarka dw&oacute;ch rozmar&oacute;w wtyczek</li>\r\n	<li>Wbudowana obcinarka oraz ściągacz</li>\r\n	<li>Precyzyjny uchwyt</li>\r\n	<li>Rozmiar kompaktowy, łatwa do uchwytu</li>\r\n	<li>Mechanizm zapadkowy zachowuje narzędzie zamknięte kiedy nie jest używane</li>\r\n	<li>1 rok gwarancji producenta</li>\r\n	<li>Polska strona producenta: <strong><strong>TC-CT68</strong></strong> (www.trendnet.com.pl)</li>\r\n</ul>\r\n', '2016-08-18 20:30:37', 1, 0, 0, 1, 2, 'acces', 18, 1),
(80, '8-Portowy panel krosujący Cat. ', 56, 'Paneli', '8-Portowy panel krosujący Cat. ', '8-Portowy panel krosujący Cat. ', '<ul>\r\n	<li>8 x 1000Base-T Gigabit RJ-45</li>\r\n	<li>Obsługuje połączenia o częstotliwości 100MHz&nbsp;</li>\r\n	<li>Oznaczenia kolorami dla &nbsp;Cat.5e (T568A oraz &nbsp;T568B)</li>\r\n</ul>\r\n', 'acces-8091.jpg', '<p>8-Portowy panel krosujący &nbsp;Cat.5e (Bezosłonowy), model <strong>TC-P08C5E</strong>, umożliwia połączenia do 100MHz dla 8x port&oacute;w Gigabit RJ-45 Ethernet.</p>\r\n\r\n<p>Nad każdym portem znajduje się powierzchnia do opisania portu.</p>\r\n', '<p>Cat.5e (Bezosłonowy), model TC-P08C5E, umożliwia połączenia do 100MHz dla 8x port&oacute;w Gigabit RJ-45 Ethernet.</p>\r\n', '<ul>\r\n	<li>8 x 1000Base-T Gigabit RJ-45</li>\r\n	<li>Obsługuje połączenia o częstotliwości 100MHz&nbsp;</li>\r\n	<li>Oznaczenia kolorami dla &nbsp;Cat.5e (T568A oraz &nbsp;T568B)</li>\r\n	<li>Kompatybilność blok&oacute;w &nbsp;IDC ze złączami 110 oraz Krone</li>\r\n	<li>Oznaczniki przy każdym porcie</li>\r\n	<li>Wydajność transmisji Cat. 5e zgodna ze standardami ANSI, TIA, oraz EIA 568 B.2</li>\r\n	<li>W zestawie nylonowe opaski i uchwyty</li>\r\n	<li>2-lata gwarancji producenta</li>\r\n</ul>\r\n', '2016-08-18 20:35:04', 0, 0, 1, 1, 2, 'acces', 18, 1),
(81, 'Gumowa osłona wtyku RJ-45', 0, 'Inne', 'Gumowa osłona wtyku RJ-45', 'Gumowa osłona wtyku RJ-45', '<p>Osłona wtyku RJ-45 (8p8c) wykonana w miękkiego tworzywa. Dzięki dużej elastyczności pasuje na r&oacute;żnego rodzaju kable: UTP, FTP, STP. Zabezpiecza wtyk przed kurzem, wilgocią oraz wyłamaniem klipsa. Opakowanie 100szt.</p>\r\n', 'acces-8116.jpg', '<p>Osłona wtyku RJ-45 (8p8c) wykonana w miękkiego tworzywa. Dzięki dużej elastyczności pasuje na r&oacute;żnego rodzaju kable: UTP, FTP, STP. Zabezpiecza wtyk przed kurzem, wilgocią oraz wyłamaniem klipsa. Opakowanie 100szt.</p>\r\n', '<p>Osłona wtyku RJ-45 (8p8c) wykonana w miękkiego tworzywa. Dzięki dużej elastyczności pasuje na r&oacute;żnego rodzaju kable: UTP, FTP, STP.</p>\r\n', '<table align="left" border="1" cellpadding="0" cellspacing="0" style="width:500px">\r\n	<tbody>\r\n		<tr>\r\n			<td><strong>Algorytm szyfrowania</strong></td>\r\n			<td>LEAP, DES, Triple DES, MD5, TLS, PEAP, TTLS, TKIP, WPA, WPA2, WPA-PSK, PKI, 128-bit AES, 192-bit AES, 256-bit AES</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Metoda uwierzytelniania</strong></td>\r\n			<td>RADIUS, TACACS+</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Cechy</strong></td>\r\n			<td>Autowykrywanie urządzenia, NAT, VLAN, auto-uplink (auto MDI/MDI-X), Stateful Packet Inspection (SPI), Filtrowanie adres&oacute;w MAC, Class-Based Wagaed Fair Queuing (CBWFQ), Wagaed Fair Queuing (WFQ), Access Control List (ACL), Quality of Service (QoS), DHCP server, DNS proxy</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Zgodność z normami</strong></td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>RAM</strong></td>\r\n			<td>512 MB (zainstalowany) / 768 MB (maks.) - DDR2 SDRAM - SO-DIMM 200-pin</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Flash</strong></td>\r\n			<td>256 MB</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Interfejsy</strong></td>\r\n			<td>LAN : 4 porty 10Base-T/100Base-TX RJ-45<br />\r\n			WAN : 1 port 10Base-T/100Base-TX RJ-45<br />\r\n			Zarządzanie : 1 port konsolowy RJ-45<br />\r\n			USB : 1 port 4 PIN USB Typ A</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Zastosowane technologie</td>\r\n			<td>WPS , 64/128-bit WEP , WPA2-PSK , WPA-PSK</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Sloty</strong></td>\r\n			<td>1 og&oacute;łem / 1 wolny slot na ExpressCard<br />\r\n			1 og&oacute;łem / 1 wolny slot na SO-DIMM 200-pin</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Zasilacz</strong></td>\r\n			<td>Zasilacz zewnętrzny - 60 Watt</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n', '2016-08-18 20:38:56', 1, 0, 0, 1, 0, 'acces', 22, 1),
(82, 'Próbnik sieciowy do TC-NT2', 168, 'Inne', 'Próbnik sieciowy ', 'Próbnik sieciowy ', '<ul>\r\n	<li>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Kompatybilny z większością generator&oacute;w dźwięku</li>\r\n	<li>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Końc&oacute;wka kompozytowa redukująca zagrożenie porażeniem</li>\r\n	<li>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Wbudowany głośnik z regulowanym poziomem wzmocnienia</li>\r\n</ul>\r\n', 'acces-8251.jpg', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Łatwa do użycia cewka wzmacniacza TRENDnet TC-TP1 oraz pr&oacute;bnik dźwieku są używane do śledzenia dźwieku oraz testowania linii. Zadaniem TC-TP1 push button jest zapewnienie prostej obsługi oraz oszczędność zasilania bateryjnego. To zaprojektowane ergonomicznie urządzenie wyposażone jest w regulowany poziom dżwięku oraz sygnalizację LED dla zwiększenia możliwości w hałaśliwym środowisku. TC-TP1 umożliwia r&oacute;wnież wykrywanie biegunowości złącza kołowego.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Gdy jest użyte z komaptybilnym generatorem dźwięku, umożliwia szybkie i efektywnie zlokalizowanie, wyizolowanie oraz testowanie używanego dźwięku w kablach przesyłowych.</p>\r\n', '<p>Łatwa do użycia cewka wzmacniacza TRENDnet TC-TP1 oraz pr&oacute;bnik dźwieku są używane do śledzenia dźwieku oraz testowania linii.</p>\r\n', '<ul>\r\n	<li>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Wtyczka do słuchawek (2.5 mm) dla używających sluchawki np. w otoczeniu hałaśliwym.</li>\r\n	<li>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp; Tonowa sygnalizacja LED</li>\r\n	<li>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Wykrywa zasilanie AC lub DC do 24 Volt&oacute;w</li>\r\n	<li>&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; Identyfikuje polaryzację złącza analogowego oraz weryfikuje funkcjonowanie linii</li>\r\n	<li>&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; Wyposażony jest w gniazdo RJ-45 oraz w kr&oacute;tki łącznik RJ-11</li>\r\n	<li>&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; Terminale +/- dla wtyk&oacute;w bananowych lub złączy krokodylkowych</li>\r\n	<li>&nbsp;&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; Wciśnij przycisk dla prostej operacji oraz konserwacji zasilania bateryjnego</li>\r\n	<li>&nbsp;&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; Połączenie Lanyard dla szybkiego dostępu do pr&oacute;bnika</li>\r\n	<li>&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; Roczna gwarancja producenta</li>\r\n</ul>\r\n', '2016-08-18 20:42:53', 0, 1, 1, 1, 0, 'acces', 22, 1),
(83, 'Profesjonalna zaciskarka do kabli typu Impact', 85, 'Zaciskacze', 'Profesjonalna zaciskarka ', 'Profesjonalna zaciskarka ', '<ul>\r\n	<li>Kształt komfortowy, łatwy do uchwytu</li>\r\n	<li>Łopatki wymienne i odwracalne</li>\r\n	<li>Magazynek dla przechowywania ostrzy</li>\r\n	<li>Oprawa typu Twist + Lock zapewnia szybką i łatwą wymianę ostrzy oraz zabezpiecza przed odciągnieciem ostrzy</li>\r\n	<li>Roczna gwarancja producenta</li>\r\n</ul>\r\n', 'acces-8383.jpg', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Profesjonalna zaciskarka do kabli TRENDnet, TC-PDT z ostrzami 110 oraz Krone umożliwia włożenie i ucięcie końc&oacute;wek w jednej operacji. Regulowane wysokie i niskie ustawienia wymaganych zakończeń w zależności od preferencji użytkownika. Profesjonalna zaciskarka do kabli oferuje łatwość do użycia oraz przystępną cenę.</p>\r\n', '<p>Profesjonalna zaciskarka do kabli TRENDnet, TC-PDT z ostrzami 110 oraz Krone umożliwia włożenie i ucięcie końc&oacute;wek w jednej operacji.</p>\r\n', '<table align="left" border="1" cellpadding="0" cellspacing="0" style="width:500px">\r\n	<tbody>\r\n		<tr>\r\n			<td><strong>Algorytm szyfrowania</strong></td>\r\n			<td>LEAP, DES, Triple DES, MD5, TLS, PEAP, TTLS, TKIP, WPA, WPA2, WPA-PSK, PKI, 128-bit AES, 192-bit AES, 256-bit AES</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Metoda uwierzytelniania</strong></td>\r\n			<td>RADIUS, TACACS+</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Cechy</strong></td>\r\n			<td>Autowykrywanie urządzenia, NAT, VLAN, auto-uplink (auto MDI/MDI-X), Stateful Packet Inspection (SPI), Filtrowanie adres&oacute;w MAC, Class-Based Wagaed Fair Queuing (CBWFQ), Wagaed Fair Queuing (WFQ), Access Control List (ACL), Quality of Service (QoS), DHCP server, DNS proxy</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Zgodność z normami</strong></td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>RAM</strong></td>\r\n			<td>512 MB (zainstalowany) / 768 MB (maks.) - DDR2 SDRAM - SO-DIMM 200-pin</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Flash</strong></td>\r\n			<td>256 MB</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Interfejsy</strong></td>\r\n			<td>LAN : 4 porty 10Base-T/100Base-TX RJ-45<br />\r\n			WAN : 1 port 10Base-T/100Base-TX RJ-45<br />\r\n			Zarządzanie : 1 port konsolowy RJ-45<br />\r\n			USB : 1 port 4 PIN USB Typ A</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Zastosowane technologie</td>\r\n			<td>WPS , 64/128-bit WEP , WPA2-PSK , WPA-PSK</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Sloty</strong></td>\r\n			<td>1 og&oacute;łem / 1 wolny slot na ExpressCard<br />\r\n			1 og&oacute;łem / 1 wolny slot na SO-DIMM 200-pin</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Zasilacz</strong></td>\r\n			<td>Zasilacz zewnętrzny - 60 Watt</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n', '2016-08-18 20:50:32', 1, 0, 0, 1, 1, 'acces', 19, 1),
(84, 'Profesjonalny tester kabli z generatorem dźwięku', 197, 'Inne', 'Profesjonalny tester kabli ', 'Profesjonalny tester kabli ', '<ul>\r\n	<li>Weryfikuje ciagłość kabli, otwarcia, skr&oacute;cenia i zagubienia</li>\r\n	<li>Testuje kable do 300 metr&oacute;w</li>\r\n	<li>Tryb Auto-Scan lub Manual-Scan</li>\r\n	<li>Zawiera specjalną ochronną torbę, dwa adaptery RJ45 do BNC oraz kabel krosujący RJ45</li>\r\n	<li>Roczna gwarancja producenta</li>\r\n</ul>\r\n', 'acces-8495.jpg', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; TC-NT2 jest wygodnym oraz kompletnym testerem kabli dla profesjonalist&oacute;w zarządzających siecią. Jego rozbudowane cechy umożliwiają instalację sieci z prawidłową poprawnością konfiguracji styk&oacute;w kabli dla r&oacute;żnych sygnał&oacute;w oraz komunikacji danych. TC-NT2 zawiera moduł gł&oacute;wny, kt&oacute;ry przesyła sygnały testowe do jego zewnętrznego rdzenia terminatora (corre-sponding) dla weryfikacji niezawodności kabli. Sprawdza ciągłość i pokazuje konfigurację okablowania do 300 metr&oacute;w instalacji kablowej.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Dzięki unikalnej funkcji generatora ton&oacute;w, TC-NT2 indentyfikuje i monitoruje kable dla zapewnienia poprawności styk&oacute;w oraz struktury okablowania.</p>\r\n', '<p>TC-NT2 jest wygodnym oraz kompletnym testerem kabli dla profesjonalist&oacute;w zarządzających siecią.</p>\r\n', '<table align="left" border="1" cellpadding="0" cellspacing="0" style="width:500px">\r\n	<tbody>\r\n		<tr>\r\n			<td>Testuje konfigurację złączy kabl</td>\r\n			<td>10/100/1000Base-T, 10Base-2 (coax), RJ-11/RJ-12/RJ-45, EIA/TIA-356A/568A/568B oraz Token Ring</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Metoda uwierzytelniania</strong></td>\r\n			<td>RADIUS, TACACS+</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Cechy</strong></td>\r\n			<td>Autowykrywanie urządzenia, NAT, VLAN, auto-uplink (auto MDI/MDI-X), Stateful Packet Inspection (SPI), Filtrowanie adres&oacute;w MAC, Class-Based Wagaed Fair Queuing (CBWFQ), Wagaed Fair Queuing (WFQ), Access Control List (ACL), Quality of Service (QoS), DHCP server, DNS proxy</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Zgodność z normami</strong></td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>RAM</strong></td>\r\n			<td>512 MB (zainstalowany) / 768 MB (maks.) - DDR2 SDRAM - SO-DIMM 200-pin</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Flash</strong></td>\r\n			<td>256 MB</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Interfejsy</strong></td>\r\n			<td>LAN : 4 porty 10Base-T/100Base-TX RJ-45<br />\r\n			WAN : 1 port 10Base-T/100Base-TX RJ-45<br />\r\n			Zarządzanie : 1 port konsolowy RJ-45<br />\r\n			USB : 1 port 4 PIN USB Typ A</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Zastosowane technologie</td>\r\n			<td>WPS , 64/128-bit WEP , WPA2-PSK , WPA-PSK</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Sloty</strong></td>\r\n			<td>1 og&oacute;łem / 1 wolny slot na ExpressCard<br />\r\n			1 og&oacute;łem / 1 wolny slot na SO-DIMM 200-pin</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Zasilacz</strong></td>\r\n			<td>Zasilacz zewnętrzny - 60 Watt</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n', '2016-08-18 20:56:07', 0, 0, 1, 1, 2, 'acces', 22, 1),
(85, '8-Portowy panel krosujący Cat. 6 ', 73, 'Paneli', '8-Portowy panel krosujący', '8-Portowy panel krosujący', '<p><strong>ZAWARTOŚĆ ZESTAWU</strong></p>\r\n\r\n<ul>\r\n	<li><strong>TC-P08C6</strong></li>\r\n	<li>Poradnik szybkiej instalacji</li>\r\n	<li>Uchwyty i opaski</li>\r\n</ul>\r\n', 'acces-8582.png', '<p>8-Portowy panel krosujący &nbsp;Cat.6 (Bezosłonowy), model <strong>TC-P08C6</strong>, umożliwia połączenia do 250MHz dla 8x port&oacute;w Gigabit RJ-45 Ethernet.</p>\r\n\r\n<p>Nad każdym portem znajduje się powierzchnia do opisania portu.</p>\r\n', '<p>model TC-P08C6, umożliwia połączenia do 250MHz dla 8x port&oacute;w Gigabit RJ-45 Ethernet.</p>\r\n', '<ul>\r\n	<li>8 x 1000Base-T Gigabit RJ-45</li>\r\n	<li>Obsługuje połączenia o częstotliwości 250MHz</li>\r\n	<li>Oznaczenia kolorami dla &nbsp;Cat.6 (T568A oraz &nbsp;T568B)</li>\r\n	<li>Kompatybilność blok&oacute;w &nbsp;IDC ze złączami 110 oraz Krone</li>\r\n	<li>Oznaczniki przy każdym porcie</li>\r\n	<li>Wydajność transmisji Cat. 6 zgodna ze standardami ANSI, TIA, oraz EIA 568 B.2</li>\r\n	<li>W zestawie nylonowe opaski i uchwyty</li>\r\n	<li>2-lata gwarancji producenta</li>\r\n</ul>\r\n', '2016-08-18 20:59:55', 0, 0, 1, 1, 1, 'acces', 18, 1),
(86, '12-Portowy panel krosujący Cat. 6 ', 83, 'Paneli', '12-Portowy panel krosujący', '12-Portowy panel krosujący', '<ul>\r\n	<li>12 x 1000Base-T Gigabit RJ-45</li>\r\n	<li>Obsługuje połączenia o częstotliwości 250MHz</li>\r\n	<li>Oznaczenia kolorami dla &nbsp;Cat. 6 (T568A oraz T568B)</li>\r\n</ul>\r\n', 'acces-8689.jpg', '<p>12-Portowy panel krosujący &nbsp;Cat. 6 (Bezosłonowy), model TC-P12C6, umożliwia połączenia do 250MHz dla 12x port&oacute;w Gigabit RJ-45 Ethernet.</p>\r\n\r\n<p>Nad każdym portem znajduje się powierzchnia do opisania portu.</p>\r\n', '<p>model TC-P12C6, umożliwia połączenia do 250MHz dla 12x port&oacute;w Gigabit RJ-45 Ethernet.</p>\r\n', '<ul>\r\n	<li>12 x 1000Base-T Gigabit RJ-45</li>\r\n	<li>Obsługuje połączenia o częstotliwości 250MHz</li>\r\n	<li>Oznaczenia kolorami dla &nbsp;Cat. 6 (T568A oraz T568B)</li>\r\n	<li>Kompatybilność blok&oacute;w &nbsp;IDC ze złączami 110 oraz Krone</li>\r\n	<li>Oznaczniki przy każdym porcie</li>\r\n	<li>Wydajność transmisji Cat. 6 zgodna ze standardami ANSI, TIA, oraz EIA 568 B.2</li>\r\n	<li>W zestawie nylonowe opaski i uchwyty</li>\r\n	<li>2-lata gwarancji producenta</li>\r\n</ul>\r\n', '2016-08-18 21:04:20', 0, 1, 1, 1, 0, 'acces', 18, 1),
(87, '16-portowy panel krosujący kat 5e', 106, 'Paneli', '16-portowy panel', '16-portowy panel', '<ul>\r\n	<li>&nbsp; Zgodne z 1000Base-T Gigabit Copper Ethernet.</li>\r\n	<li>&nbsp; Kompatybilność z okablowaniem kat 3, 4 oraz 5.</li>\r\n	<li>&nbsp; Wykonanie EIA/TIA 568A oraz ISO/IEC 11801.</li>\r\n</ul>\r\n', 'acces-8724.jpg', '<p>Przygotuj się na rozwiązania Copper Gigabit Ethernet ze złączami krosującymi TRENDnet kat 5e RJ-45 UTP Patch. Nasze złącza posiadają certyfikaty 350Mhz kat 5e, i dlatego są dedykowane dla Copper Gigabit Ethernet. 16/24/48-portowe 350 Mhz rozszerzone złącza kat 5 są idealne dla aplikacji sieciowych Ethernet/Fast Ethernet/Gigabit Ethernet (1000Base-T).</p>\r\n', '<p>Przygotuj się na rozwiązania Copper Gigabit Ethernet ze złączami krosującymi TRENDnet kat 5e RJ-45 UTP Patch.</p>\r\n', '<table align="left" border="1" cellpadding="0" cellspacing="0" style="width:500px">\r\n	<tbody>\r\n		<tr>\r\n			<td>Testuje konfigurację złączy kabl</td>\r\n			<td>10/100/1000Base-T, 10Base-2 (coax), RJ-11/RJ-12/RJ-45, EIA/TIA-356A/568A/568B oraz Token Ring</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Metoda uwierzytelniania</strong></td>\r\n			<td>RADIUS, TACACS+</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Cechy</strong></td>\r\n			<td>Autowykrywanie urządzenia, NAT, VLAN, auto-uplink (auto MDI/MDI-X), Stateful Packet Inspection (SPI), Filtrowanie adres&oacute;w MAC, Class-Based Wagaed Fair Queuing (CBWFQ), Wagaed Fair Queuing (WFQ), Access Control List (ACL), Quality of Service (QoS), DHCP server, DNS proxy</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Zgodność z normami</strong></td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>RAM</strong></td>\r\n			<td>512 MB (zainstalowany) / 768 MB (maks.) - DDR2 SDRAM - SO-DIMM 200-pin</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Flash</strong></td>\r\n			<td>256 MB</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Interfejsy</strong></td>\r\n			<td>LAN : 4 porty 10Base-T/100Base-TX RJ-45<br />\r\n			WAN : 1 port 10Base-T/100Base-TX RJ-45<br />\r\n			Zarządzanie : 1 port konsolowy RJ-45<br />\r\n			USB : 1 port 4 PIN USB Typ A</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Zastosowane technologie</td>\r\n			<td>WPS , 64/128-bit WEP , WPA2-PSK , WPA-PSK</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Sloty</strong></td>\r\n			<td>1 og&oacute;łem / 1 wolny slot na ExpressCard<br />\r\n			1 og&oacute;łem / 1 wolny slot na SO-DIMM 200-pin</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Zasilacz</strong></td>\r\n			<td>Zasilacz zewnętrzny - 60 Watt</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n', '2016-08-18 21:09:42', 0, 0, 1, 1, 2, 'acces', 18, 1),
(88, '48-portowy panel krosujący kat 6 RJ-45 UTP 19-calowy', 298, 'Paneli', '48-portowy panel krosujący ', '48-portowy panel krosujący ', '<ul>\r\n	<li>180&deg; typu kątowego (poziomy)</li>\r\n	<li>Zgodne z 1000Base-T Copper Gigabit Ethernet</li>\r\n	<li>Kompatybilny z okablowaniem kat 3, 4, 5, 5e oraz 6</li>\r\n</ul>\r\n', 'acces-8888.jpg', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Przygotuj się na Copper Gigabit Ethernet z panelami krosującymi kat 6 RJ-45 UTP. Nasze panele krosujące posiadają certyfikaty dla 250Mhz kat 6, co zapewniają perfekcyjne połączenia do Copper Gigabit Ethernet. 48-portowy panel krosujący kat 6 nadaje się idealne dla aplikacji sieciowych Ethernet, Fast Ethernet i Copper Gigabit Ethernet (1000Base-T).</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Używając teraz produkt&oacute;w TRENDnet kat 6, będziesz przygotowany na sieci wysokiej szerokości pasma bez zmiany okablowania swojej sieci w przyszłości.</p>\r\n', '<p>48-portowy panel krosujący kat 6 nadaje się idealne dla aplikacji sieciowych Ethernet, Fast Ethernet i Copper Gigabit Ethernet (1000Base-T).</p>\r\n', '<table align="left" border="1" cellpadding="0" cellspacing="0" style="width:500px">\r\n	<tbody>\r\n		<tr>\r\n			<td>Testuje konfigurację złączy kabl</td>\r\n			<td>10/100/1000Base-T, 10Base-2 (coax), RJ-11/RJ-12/RJ-45, EIA/TIA-356A/568A/568B oraz Token Ring</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Metoda uwierzytelniania</strong></td>\r\n			<td>RADIUS, TACACS+</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Cechy</strong></td>\r\n			<td>Autowykrywanie urządzenia, NAT, VLAN, auto-uplink (auto MDI/MDI-X), Stateful Packet Inspection (SPI), Filtrowanie adres&oacute;w MAC, Class-Based Wagaed Fair Queuing (CBWFQ), Wagaed Fair Queuing (WFQ), Access Control List (ACL), Quality of Service (QoS), DHCP server, DNS proxy</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Zgodność z normami</strong></td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>RAM</strong></td>\r\n			<td>512 MB (zainstalowany) / 768 MB (maks.) - DDR2 SDRAM - SO-DIMM 200-pin</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Flash</strong></td>\r\n			<td>256 MB</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Interfejsy</strong></td>\r\n			<td>LAN : 4 porty 10Base-T/100Base-TX RJ-45<br />\r\n			WAN : 1 port 10Base-T/100Base-TX RJ-45<br />\r\n			Zarządzanie : 1 port konsolowy RJ-45<br />\r\n			USB : 1 port 4 PIN USB Typ A</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Zastosowane technologie</td>\r\n			<td>WPS , 64/128-bit WEP , WPA2-PSK , WPA-PSK</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Sloty</strong></td>\r\n			<td>1 og&oacute;łem / 1 wolny slot na ExpressCard<br />\r\n			1 og&oacute;łem / 1 wolny slot na SO-DIMM 200-pin</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Zasilacz</strong></td>\r\n			<td>Zasilacz zewnętrzny - 60 Watt</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n', '2016-08-18 21:18:53', 0, 1, 0, 1, 3, 'acces', 18, 1),
(89, 'Wtyk modularny 8 pin na drut ', 1, 'Wtyczki', 'Wtyk modularny 8 pin ', 'Wtyk modularny 8 pin', '<ul>\r\n	<li>Złącze męskie 8P8C,</li>\r\n	<li>kategorii 5e,</li>\r\n	<li>na przew&oacute;d okrągły, drut.</li>\r\n</ul>\r\n', 'acces-8967.jpg', '', '<p>Złącze RJ-45 sprzedawane jest na sztuki z pozycji J2008 na opakowania (100 szt.) z pozycji J2007.</p>\r\n', '', '2016-08-18 21:21:51', 1, 0, 0, 1, 0, 'acces', 19, 1),
(90, 'Zaciskacz NT-268 do złączy modularnych ', 67, 'Zaciskacze', 'Zaciskacz ', 'Zaciskacz ', '<ul>\r\n	<li>obcinarka i ściągacz izolacji</li>\r\n	<li>wbudowany mechanizm blokady powrotu</li>\r\n</ul>\r\n', 'acces-9016.jpg', '', '<p>Zaciskacz złączy modularnych 8P8C (RJ-45), 6P6C (RJ-12), 6P4C (RJ-11)</p>\r\n', '<table align="left" border="1" cellpadding="0" cellspacing="0" style="width:500px">\r\n	<tbody>\r\n		<tr>\r\n			<td>Testuje konfigurację złączy kabl</td>\r\n			<td>10/100/1000Base-T, 10Base-2 (coax), RJ-11/RJ-12/RJ-45, EIA/TIA-356A/568A/568B oraz Token Ring</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Metoda uwierzytelniania</strong></td>\r\n			<td>RADIUS, TACACS+</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Cechy</strong></td>\r\n			<td>Autowykrywanie urządzenia, NAT, VLAN, auto-uplink (auto MDI/MDI-X), Stateful Packet Inspection (SPI), Filtrowanie adres&oacute;w MAC, Class-Based Wagaed Fair Queuing (CBWFQ), Wagaed Fair Queuing (WFQ), Access Control List (ACL), Quality of Service (QoS), DHCP server, DNS proxy</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Zgodność z normami</strong></td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>RAM</strong></td>\r\n			<td>512 MB (zainstalowany) / 768 MB (maks.) - DDR2 SDRAM - SO-DIMM 200-pin</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Flash</strong></td>\r\n			<td>256 MB</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Interfejsy</strong></td>\r\n			<td>LAN : 4 porty 10Base-T/100Base-TX RJ-45<br />\r\n			WAN : 1 port 10Base-T/100Base-TX RJ-45<br />\r\n			Zarządzanie : 1 port konsolowy RJ-45<br />\r\n			USB : 1 port 4 PIN USB Typ A</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Zastosowane technologie</td>\r\n			<td>WPS , 64/128-bit WEP , WPA2-PSK , WPA-PSK</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Sloty</strong></td>\r\n			<td>1 og&oacute;łem / 1 wolny slot na ExpressCard<br />\r\n			1 og&oacute;łem / 1 wolny slot na SO-DIMM 200-pin</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Zasilacz</strong></td>\r\n			<td>Zasilacz zewnę