(92, 'Zaciskarka złączy koncentrycznych', 77, 'Zaciskacze', 'Zaciskarka złączy koncentrycznych', 'Zaciskarka złączy koncentrycznych', '<p>Wykonana ze stali węglowej. Wyposażona w mechanizm blokady powrotu ramion oraz regulację głębokości zagniatania. Zastosowanie: Średnica zaciskania 2,54 mm, 3,25 mm, 10,9</p>\r\n', 'acces-9254.jpg', '<p>Wykonana ze stali węglowej. Wyposażona w mechanizm blokady powrotu ramion oraz regulację głębokości zagniatania.</p>\r\n', '<p>Zaciskarka złączy koncentrycznych na kabel MRC400/H1000</p>\r\n', '<table align="left" border="1" cellpadding="0" cellspacing="0" style="width:500px">\r\n	<tbody>\r\n		<tr>\r\n			<td>Średnica zaciskania</td>\r\n			<td>\r\n			<table border="0" cellpadding="0" cellspacing="0" style="width:529px">\r\n				<tbody>\r\n					<tr>\r\n						<td style="height:22px; width:284px">\r\n						<p>2,54 mm,</p>\r\n						</td>\r\n					</tr>\r\n					<tr>\r\n						<td style="height:19px; width:284px">\r\n						<p>3,25 mm,</p>\r\n						</td>\r\n					</tr>\r\n					<tr>\r\n						<td style="height:19px; width:284px">\r\n						<p>10,9 mm</p>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Typy złączy</td>\r\n			<td>LC, RG8, RG11, RG174, RG213, H1000, CNT400,&nbsp;MRC400, &nbsp;Tri-LAN 400,</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Typy przewod&oacute;w</td>\r\n			<td>ŚWIATŁOWODOWE</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n', '2016-08-18 22:01:36', 1, 1, 1, 1, 2, 'acces', 19, 1),
(93, 'Zaciskarka złączy koncentrycznych', 91, 'Zaciskacze', 'Zaciskarka złączy koncentrycznych', 'Zaciskarka złączy koncentrycznych', '<p>Wykonana ze stali węglowej. Wyposażona w mechanizm blokady powrotu ramion oraz regulację głębokości zagniatania.</p>\r\n', 'acces-9377.jpg', '', '<p>Zaciskarka złączy koncentrycznych na kabel h155/h1000</p>\r\n', '', '2016-08-18 22:05:39', 0, 1, 0, 1, 3, 'acces', 19, 1),
(94, 'Zaciskacz uniwersalny PCT-AIO-CT', 220, 'Zaciskacze', 'Zaciskacz uniwersalny', 'Zaciskacz uniwersalny', '<ul>\r\n	<li>zaciska złącza kompresyjne F, RCA, BNC, IEC,</li>\r\n	<li>zaciska złącza w r&oacute;żnej długości - wbudowany reduktor skoku tłoczyska</li>\r\n	<li>zaciska złącza na kablach klasy RG-59, RG-6</li>\r\n</ul>\r\n', 'acces-9412.jpg', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Instrukcja poprawnego przygotowania przewodu i zaciśnięcia złącza kompresyjnego BNC&nbsp;E8293&nbsp;<br />\r\nzaciskaczem PCT-AIO-CT&nbsp;E80075W każdym z Oddział&oacute;w firmy DIPOL instalatorzy mogą bezpłatnie zacisnąć złącze&nbsp;<br />\r\ni przekonać się osobiście jak łatwa jest to czynność</p>\r\n', '<p>Zaciskacz uniwersalny</p>\r\n', '<ul>\r\n	<li>narzędzie o dużej trwałości, wykonane z najwyższej jakości materiał&oacute;w,</li>\r\n	<li>kompaktowe rozmiary,</li>\r\n	<li>blokada dźwigni przy przechowywaniu,</li>\r\n	<li>zaciska złącza kompresyjne F, RCA, BNC, IEC,</li>\r\n	<li>zaciska złącza w r&oacute;żnej długości - wbudowany reduktor skoku tłoczyska</li>\r\n	<li>zaciska złącza na kablach klasy RG-59, RG-6</li>\r\n	<li>dostrojenie narzędzia do wybranego złącza i przewodu następuje przez:\r\n	<ul>\r\n		<li>zastosowanie odpowiedniej końc&oacute;wki tłoczyska</li>\r\n		<li>odpowiednie ustawienie element&oacute;w zderzaka do rodzaju złącza i średnicy przewodu</li>\r\n		<li>ustawienie skoku tłoczyska</li>\r\n	</ul>\r\n	</li>\r\n	<li>konstrukcja tego zaciskacza chroniona jest licznymi patentami,</li>\r\n</ul>\r\n', '2016-08-18 22:11:57', 1, 0, 0, 1, 4, 'acces', 19, 1);
